INSERT INTO `pr_properties` VALUES ('1033', null, '1500.00', '<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Available now is this huge 5 bedrooms, 2 reception rooms detached house in the heart of Brondesbury Park.<?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Set over two floors the property offers a large entrance leading to two reception rooms, a large dining room, a three piece bathroom and a kitchen with utility room.<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">On the first floor, 5 bedrooms compliments the property with another family bathroom and one en suite in the master bedroom.<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">The house also benefits from gated parking, a garage and a impressive garden.<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Located close to Queen’s Park and the trendy bars, cafes and shops of Salusbury Road. Easy access to Brondesbury Park Station (overground) and Queen’s Park ( Bakerloo line)<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\"><o:p>&nbsp;</o:p></SPAN></P>', '', '', '250', '4', '5', '3', '3', '', '76', 'The Avenue, Brondesbury Park', '0', '0', '0', 'NW6', '0000-00-00', '0000-00-00', '0000-00-00', '1', '1', '1', '3', '1', '1', '1', '0', null,