INSERT INTO `pr_properties` VALUES ('1056', null, '500.00', '<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Spacious three double bedroom flat available in the heart of Queens Park. <?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">The property offers three double bedrooms, a bright living room, good size kitchen, large bathroom, separate toilet and a charming roof terrace. The flat has been newly refurbished. <o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Located less than 2 minutes’ walk from Queens Park Station (Bakerloo line) and close to pubs, shops and restaurants of the trendy Salusbury Road. <o:p></o:p></SPAN></P>', '', '', '262', '40', '3', '2', '1', '', '32', 'Salusbury Road', '0', '0', '0', 'NW6', '0000-00-00', '0000-00-00', '0000-00-00', '1', '1', '1', '3', '1', '1', '1', '0', null, null, '2011-10-27 17:01:27', '2011-10-27 17:01:27', '2166.00', '4', '2');
INSERT INTO `pr_properties` VALUES ('1057', null, '320.00', '<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Available for rent is this 2 bedroom first floor flat on a nice quiet street less than 0.3 miles away from Willesden Junction Station, other transport links and amenities of the high street.<?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\"><SPAN style=\"mso-spacerun: yes\">&nbsp;</SPAN>The property offers a bright and spacious living room, a separate kitchen, a double and single bedroom. <o:p></o:p></SPAN></P>\r\n<P>&nbsp;</P>', '', '', '333', '26', '2', '1', '1', '', '0', 'Leghorn Road', '0', '0', '0', 'NW10', '0000-00-00', '0000-00-00', '0000-00-00', '1', '1', '1', '3', '1', '1', '1', '0', null, null, '2011-11-01 12:46:59', '2011-11-07 11:51:55', '1387.00', '4', '2');
INSERT INTO `pr_properties` VALUES ('1060', null, '750.00', '<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Thirteen newly-built 1, 2 and 3 bedroom apartments located close to Maida Vale<SPAN style=\"mso-spacerun: yes\">&nbsp;&nbsp; </SPAN>for local shops and transport facilities, many of the apartments have outside<SPAN style=\"mso-spacerun: yes\">&nbsp;&nbsp; </SPAN>space. <?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">The building also has a lift and thirteen underground parking spaces<SPAN style=\"mso-spacerun: yes\">&nbsp;&nbsp; </SPAN>available to rent under separate negotiation<o:p></o:p></SPAN></P>', '', '', '259', '26', '3', '2', '1', '', '0', 'Sutherland Avenue', '0', '0', '0', 'W9', '0000-00-00', '0000-00-00', '0000-00-00', '1', '1', '0', '1', '1', '1', '1', '0', null, null, '2011-11-01 18:02:09', '2011-11-01 18:02:09', '3250.00', '4', '2');
INSERT INTO `pr_properties` VALUES ('1061', '359950.00', null, '<SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">New on the market, this 2 bedroom basement flat with a large back garden. <?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">The property offers a living area with an open plan kitchen, 1 reception room with can be converted as a bedroom, 2 double bedroom and a 3 piece bathroom. <o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">The flat is located at equal distance of West Hampstead, Kilburn, Brondesbury and off local amenities and transport links from the high street. <o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">Ideal for investors or buyers willing to do works. Call us for further information and arrange a viewing<o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal></SPAN>&nbsp;</P>', '', '', '258', '6', '2', '1', '2', '', '16', 'Iverson Road', '0', '0', '0', 'NW6', '0000-00-00', '2011-11-02', '2012-11-02', '1', '1', '0', '2', '2', '1', '1', '0', '0', null, '2011-11-02 17:52:31', '2011-11-02 17:56:07', null, '2', '3');
INSERT INTO `pr_properties` VALUES ('1062', '253950.00', null, '<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">We are pleased to offer this top floor 2 bedroom flat located in a residential street of Willesden junction within walking distance to the station, other transport links and amenities of the high street. <?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></SPAN></P>\r\n<P style=\"MARGIN: 0cm 0cm 10pt\" class=MsoNormal><SPAN style=\"LINE-HEIGHT: 115%; FONT-FAMILY: \'Times New Roman\',\'serif\'; FONT-SIZE: 10pt\">The property offers a bright and spacious living room, a separate kitchen, a double and single bedroom. <o:p></o:p></SPAN></P>', '', '', '333', '6', '2', '1', '1', '', '0', 'Leghorn Road', '0', '0', '0', 'NW10', '0000-00-00', '2011-11-04', '2012-11-04', '1', '1', '0', '2', '2', '1', '1', '0', '0', null, '2011-11-04 10:26:10', '2011-11-05 12:13:20', null, '1', '3');
