ribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 7/30\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10291\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/hlDLl3rpCug/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1969:\"<h3>New plugins</h3>\n<p><a href=\"http://calendarscripts.info/amy-lite.html\"><strong>A.M.Y. Lite</strong></a> is a plugin for bloggers who want to sell ads or manage their Adsense and similar ads easier.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/contact-call-plugin/\"><strong>Contact Call</strong></a> lets your web visitors call you from their browser or local access numbers in 40+ countries.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/show-shortcode/\"><strong>Show Shortcode</strong></a> lets plugin developers display their shortcodes without executing them and without any special formatting or extra work.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/tallyopia-analytics-plugin/\"><strong>Tallyopia Analytics</strong></a> provides analytics that you can embed into your site using shortcodes or view in your admin dashboard.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/easy-fancybox/\"><strong>Easy FancyBox</strong></a> enables the FancyBox 1.3.4 jQuery extension on all image, SWF, YouTube and Vimeo links.</p>\n<p><a href=\"http://www.fastsecurecontactform.com/\"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href=\"http://www.designchemical.com/blog/index.php/wordpress-plugins/wordpress-plugin-jquery-drop-down-mega-menu-widget/\"><strong>jQuery Mega Menu</strong></a> allows you to create drop down mega menus from any WordPress custom menu.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/simplereach-slide/\"><strong>SimpleReach Slide</strong></a> recommends related posts on a widget that &#8220;slides&#8221; in at the bottom of the page.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/hlDLl3rpCug\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 30 Jul 2011 13:00:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"Weblog Tools Collection: WordPress 3.3 Scope Proposed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10288\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/5rY_3I16n9o/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:951:\"<p>The plans for WordPress 3.3 <a href=\"http://wpdevel.wordpress.com/2011/07/27/wordpress-3-3-proposed-scope/\">have been laid</a>. There&#8217;s a lot to get done before <a href=\"http://weblogtoolscollection.com/archives/2011/07/21/wordpress-3-3-development-schedule-posted/\">the potential November 15th release date</a>, but it seems like we can definitely look forward to an improved media uploader, an informative welcome screen for first-time users, improved Dashboard performance, further admin bar improvements, permalink performance improvements, partial build update improvements, and various API improvements.</p>\n<p>If you can&#8217;t wait for WordPress 3.3, or just want to contribute to your favorite blogging platform, now is the perfect time to <a href=\"http://codex.wordpress.org/Contributing_to_WordPress\">get involved</a>!</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/5rY_3I16n9o\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 29 Jul 2011 13:00:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"BuddyPress: BuddyPress 1.5 – Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"http://buddypress.org/?p=1486\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://buddypress.org/2011/07/buddypress-1-5-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2657:\"<p>Wait&#8230; 1.5? What happened to 1.3? Or 1.4 for that matter?</p>\n<p>You see&#8230; BuddyPress 1.2 was released on February 16, 2010. We&#8217;ve shipped 9 point releases since then, but it&#8217;s been over 17 months since a major release of BuddyPress has come through the tubes.</p>\n<p>We do our best to mirror the WordPress development cycles as closely as possible &#8211; maybe a little too closely. Back in 2004, WordPress went through a growth spurt of its own, going 9 months between major releases (also between versions 1.2 and 1.5) so we are doing the same, and skipping ahead to 1.5 ourselves.</p>\n<p>Here are the stats we&#8217;re using to justify the version inflation:</p>\n<ul>\n<li>792 tickets closed</li>\n<li>494 confirmed bug fixes</li>\n<li>2,161 total code changes since 1.2 was released</li>\n</ul>\n<p>The similarities between BuddyPress and WordPress development symbolize the nature of developing something totally new and exciting, so we think it&#8217;s fitting to bump our version number in a similar fashion.</p>\n<p>Because of the volume of changes internally, we&#8217;re packaging up a developer beta so plugin authors have time to review our changes, report bugs, and give everyone a few weeks to tie up any loose ends that are left.</p>\n<p>If you are a BuddyPress plugin author, now is your time to help us help you, and check out all the work that&#8217;s gone into making the next version of BuddyPress faster, more efficient, more secure, and easier to code against.</p>\n<p>If you are a user or a designer, check out the changes to the BP Default theme. We&#8217;ve done our best to turn it into a theme you want to use, and have it still show off all the features too.</p>\n<p>If you are neither (or both) of those things, you can help by documenting the codex. We&#8217;re trying to do our part by writing the phpDoc as we go, and if you can help move some of that into the codex, it helps everyone!</p>\n<p>As always, please DO NOT run BuddyPress Beta software on your live production site. There are going to be quirks with existing plugins, and we will be updating code rapidly as bug reports come in. Install BuddyPress 1.5 on a local installation or a test site, and let us know if you find anything that isn&#8217;t working the way it should. We are hoping the beta period will only last a few weeks, with a release in August.</p>\n<p>You can <a href=\"https://buddypress.trac.wordpress.org/changeset/4894/tags/1.5-beta-1?old_path=%2F&format=zip\">download BuddyPress 1.5 Beta 1</a> today, from the bottom of our <a href=\"https://buddypress.trac.wordpress.org/browser/tags/1.5-beta-1\">Trac page</a>. Happy Testing!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 29 Jul 2011 03:34:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"John James Jacoby\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{