s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"Joseph: WordCamp Utah is now WordCamp SLC – September 10, 2011\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://josephscott.org/?p=4532\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://josephscott.org/archives/2011/07/wordcamp-utah-is-now-wordcamp-slc-september-10-2011/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1233:\"<p>In following with the trend to name WordCamp events in a more region specific fashion, WordCamp Utah is now <a href=\"http://2011.slc.wordcamp.org/\">WordCamp SLC</a>.  The date is set &#8211; September 10th &#8211; so mark your calendars now.</p>\n<p>I&#8217;m looking forward to another exciting event, last year we were very fortunate to have a great location at the <a href=\"http://www.utah.edu/portal/site/uuhome/\">University of Utah</a>.  With wifi that worked the whole time and plenty of power outlets under the seats, it worked out really well.  For 2011 we&#8217;ll be returning to the UoU, in the Skaggs Biology Building.  Maps are available at <a href=\"http://2011.slc.wordcamp.org/location/\">http://2011.slc.wordcamp.org/location/</a>.</p>\n<p>Additional details will be posted at the official <a href=\"http://2011.slc.wordcamp.org/blog/\">WordCamp SLC 2011 blog</a> and <a href=\"https://twitter.com/#!/wcslc\">WCSLC Twitter account</a>.  The hash tag for the event is #wcslc</p>\n<p>We&#8217;ll be putting out a call for speakers soon, and tickets should go one sale in the next week or so.  Mark September 10th on your calendars and come spend the day with other local WordPress fans, users, designers, and developers!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2011 16:12:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Joseph Scott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Matt: Constantinople + Usability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38461\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://ma.tt/2011/07/constantinople-usability/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:124:\"<p><a href=\"http://code.ipstenu.org/2011/istanbul/\">Istanbul Not Constantinople Will Confuse Your Users</a> by Ipstenu.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2011 15:44:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"Publisher Blog: FCC contributes back to open source\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"http://publisherblog.automattic.com/?p=1641\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://publisherblog.automattic.com/2011/07/26/fcc-contributes-back-to-open-source/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3140:\"<p>Earlier this month, the FCC explained why they <a href=\"http://www.fcc.gov/blog/contributing-code-back-fcc-govs-open-source-feedback-loop\">use and contribute back to open source software</a>:</p>\n<blockquote><p>Here at the FCC, we&#8217;re always excited when we can contribute to open source software. Open source software is just like any other software, except the creator publishes the underlying source code that powers the application, allowing others to improve upon or adapt the project to their own needs, and hopefully, contribute those improvements back to the community to do the same. Think of it as the software equivalent of the “give a penny, take a penny” jar at your local convenience store.</p></blockquote>\n<p>The FCC contributed back to the WordPress community in the form of a <a href=\"http://wordpress.org/extend/plugins/faceted-search-widget/\">faceted search widget</a> available in the WordPress.org plugin repository and we hope they&#8217;ll continue to contribute more code back in the future.</p>\n<p>It&#8217;s worth a read and sending to anyone you know using WordPress who could <a href=\"http://codex.wordpress.org/Contributing_to_WordPress\">contribute something back to the community via code, support, documentation or more</a>.</p>\n<p><em></em><strong><em><a href=\"http://get.wp.com/\"><strong>Want WordPress for your site? Get.WP.com</strong></a></em></strong></p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wordpresspublishers.wordpress.com/1641/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godelicious/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/delicious/wordpresspublishers.wordpress.com/1641/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gofacebook/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/facebook/wordpresspublishers.wordpress.com/1641/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gotwitter/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/twitter/wordpresspublishers.wordpress.com/1641/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gostumble/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/stumble/wordpresspublishers.wordpress.com/1641/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godigg/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/digg/wordpresspublishers.wordpress.com/1641/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/goreddit/wordpresspublishers.wordpress.com/1641/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/reddit/wordpresspublishers.wordpress.com/1641/\" /></a> <img a