ul 2011 19:22:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 7/22\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10268\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/gHDXoHEufdk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1481:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/bookmark-now/\"><strong>Bookmark Now</strong></a> enables your blog readers to share articles on social bookmark networks.</p>\n<p><a href=\"http://www.dev4press.com/plugins/gd-unit-converter/\"><strong>GD Unit Converter</strong></a> adds simple to use administration dashboard widget for converting values for currency, time, speed, length, temperature and more between different units.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/simplereach-slide/\"><strong>SimpleReach Slide</strong></a> recommends related posts on a widget that &#8220;slides&#8221; in at the bottom of the page.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://ocaoimh.ie/cookies-for-comments/\"><strong>Cookies for Comments</strong></a> sets a cookie on a random URL that is then checked when a comment is posted. If the cookie is missing the comment is marked as spam.</p>\n<p><a href=\"http://jetpack.me/\"><strong>Jetpack</strong></a> supercharges your self-hosted WordPress site with the awesome cloud power of WordPress.com.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/ui-labs/\"><strong>UI Labs</strong></a> offers experimental WordPress admin UI features with the aim of building upon and enhancing the default WordPress User Interface. These are unofficial core UI experiments &#8211; who knows what could happen?</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/gHDXoHEufdk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jul 2011 13:00:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"Matt: On WordPress 3.2 with WebProNews\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38361\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://ma.tt/2011/07/on-wordpress-3-2-with-webpronews/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:319:\"<p>Abby Johnson from WebProNews <a href=\"http://www.webpronews.com/wordpress-founder-talks-version-3-2-security-google-and-more-2011-07\">posted an interview about the philosophy and thinking behind the WordPress 3.2 release</a>, and we also recorded the video below:</p>\n<div id=\"v-jAzB26pR\" class=\"video-player\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jul 2011 22:13:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"Weblog Tools Collection: WordPress 3.3 Development Schedule Posted\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10265\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/IhroTWbwgdI/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1100:\"<p>Now that <a href=\"http://wordpress.org/\">WordPress</a> 3.2 is out of the way, the development schedule for WordPress 3.3 <a href=\"http://wpdevel.wordpress.com/version-3-3-project-schedule/\">has been posted</a>. We can look forward the overall enhancements and fixes to be confirmed next week on July 27th, with the first beta possibly landing on September 21st, and a potential final release date of November 15th.</p>\n<p>If you have been on the sidelines about contributing to WordPress, now&#8217;s the time to <a href=\"http://codex.wordpress.org/Contributing_to_WordPress\">get involved</a>. Find <a href=\"http://core.trac.wordpress.org/report/6\">a ticket to fix</a>, submit a patch for your own feature request, or just help out around the <a href=\"http://wordpress.org/support/\">forums</a> and <a href=\"http://codex.wordpress.org/Main_Page\">documentation</a>. No matter what you choose to do, make this the first release where you can proudly say, &#8220;I helped with that.&#8221;</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/IhroTWbwgdI\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jul 2011 13:00:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WordPress.tv: Matt Mullenweg on WordPress 3.2 – WebProNews Interview\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"http://wordpress.tv/?p=6625\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://wordpress.tv/2011/07/21/matt-wpn/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1782:\"<div id=\"v-jAzB26pR\" class=\"video-player\">\n</div>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/6625/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/6625/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/6625/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/6625/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/6625/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/6625/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/6625/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/6625/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=6625&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2011/07/21/matt-wpn/\"><img alt=\"Matt Mullenweg on WordPress 3.2 – WebProNews Interview\" src=\"http://videos.videopress.com/jAzB26pR/wpns11_mullenweg_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jul 2011 01:55:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Michael Pick\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"Alex King: RAMP: Easy Content Deployment for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"http://alexking.org/?p=5973\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"http://alexking.org/blog/2011/07/20/ramp-content-deploy-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2882:\"<p>I&#8217;m very excited to introduce <a href=\"http://crowdfavorite.com/wordpress/ramp/\">RAMP</a> to the WordPress community. RAMP is a new commercial product for WordPress that makes it easy to set up your content in your staging environment, then push those changes to your live site.</p>\n<p class=\"center\"><a href=\"http://www.flickr.com/photos/alexkingorg/5958532077/\" title=\"RAMP - Easy Content Deployment for WordPress by alexkingorg, on Flickr\"><img src=\"http://farm7.static.flickr.com/6024/5958532077_9432f1c57a_m.jpg\" width=\"240\" height=\"221\" alt=\"RAMP - Easy Content Deployment for WordPress\" /></a></p>\n<p>At <a href=\"http://crowdfavorite.com\">Crowd Favorite</a> we are fortunate to have some really great clients. These clients are running some pretty big web properties on WordPress, and they need to stage their content, review it internally, revise it, etc. before they put it live. It&#8217;s a pretty universal need &#8211; we just did it on our own site as we were preparing the <a href=\"http://crowdfavorite.com/wordpress/ramp/\">web page</a> and <a href=\"http://crowdfavorite.com/wordpress/ramp/docs/\">documentation</a> for RAMP on our own site. This has always been difficult with WordPress, and had often resulted in SQL export/import followed by update scripts and/or manual copy-paste steps. RAMP solves this problem elegantly. You simply:</p>\n<ol>\n<li>Install the RAMP plugin on your staging and production servers, and enter the auth key and URL from production in the settings for your staging server.</li>\n<li>Select the changes you&#8217;d like to send and save them as a batch.</li>\n<li>RAMP the batch up to your production server.</li>\n</ol>\n<p>RAMP doesn&#8217;t just support posts and pages either; it fully supports custom post types, categories, tags, custom taxonomies, users, menus, links and more.</p>\n<p></p>\n<p>We&#8217;re really proud of the underlying architecture of RAMP. We spent a long time working out just the right way to implement this type of functionality for WordPress, and I&#8217;m really pleased with the solution. We utilize core WordPress functionality and APIs, the XMLRPC layer for transport between servers, and built everything on top of an wonderfully extensible system (which uses the core WordPress hook and filter system) to allow any WordPress content to participate in a RAMP batch. We&#8217;ve already done this to <a href=\"http://crowdfavorite.com/wordpress/carrington-build/\">Carrington Build</a>.</p>\n<p>RAMP is a commercial product priced at <a href=\"https://crowdfavorite.com/store/\">$99 per staging/production server pair</a>. This includes <a href=\"http://crowdfavorite.com/wordpress/ramp/documentation/\">documentation</a> and support in our <a href=\"http://crowdfavorite.com/forums/forum/ramp\">customer forum</a>.</p>\n<img src=\"http://alexking.org/wp/?ak_action=api_record_view&id=5973&type=feed\" alt=\"\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2011 21:42:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: Pro-Patent Arguments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38358\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://ma.tt/2011/07/pro-patent-arguments/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:176:\"<p><a href=\"http://paul.kedrosky.com/archives/2011/07/the-trouble-with-nathan-myrvold.html\">The Trouble with Nathan Myhrvold’s Pro-Patent Arguments</a> by Paul Kedrosky.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2011 18:10:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Donncha: Cookies for Comments 0.5.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"http://ocaoimh.ie/?p=89496380\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"http://ocaoimh.ie/2011/07/20/cookies-for-comments-0-5-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1577:\"<p><a href=\"http://wordpress.org/extend/plugins/cookies-for-comments/\">Cookies for Comments</a> is a WordPress plugin that can be used alongside Akismet to significantly reduce or even kill completely comment spam.</p>\n<p>Version 0.5.4 adds a rejections page in case human visitors trip over the cookie check. You can modify the message shown to visitors and it&#8217;s obviously only useful if you don&#8217;t use the cookie check in your .htaccess file.</p>\n<p><img src=\"http://ocaoimh.ie/ocaoimh/2011/07/cookies-for-comments-rejection.gif\" alt=\"\" title=\"cookies-for-comments-rejection\" width=\"599\" height=\"354\" class=\"aligncenter size-full wp-image-89496381\" /></p>\n<p>It happens sometimes, usually when the visitor has cookies turned off, but very occasionally for some other reason. (That I don&#8217;t know of yet)</p>\n<p>This plugin isn&#8217;t a replacement for Akismet as it is easily bypassed. Thankfully 99% of spam bots don&#8217;t bother checking so this plugin works quite well!</p>\n\n<p><strong>Related Posts</strong><ul><li> <a href=\"http://ocaoimh.ie/cookies-for-comments/\" rel=\"bookmark\" title=\"Permanent Link: Cookies For Comments\">Cookies For Comments</a></li><li> <a href=\"http://ocaoimh.ie/2002/12/13/principalcom-cook/\" rel=\"bookmark\" title=\"Permanent Link: Principal.com &#8211; Cookies &#8211; for  &#8230;\">Principal.com &#8211; Cookies &#8211; for  &#8230;</a></li><li> <a href=\"http://ocaoimh.ie/2008/03/06/please-sir-can-i-have-more/\" rel=\"bookmark\" title=\"Permanent Link: Please sir, can I have more?\">Please sir, can I have more?</a></li></ul></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2011 17:32:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Donncha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Joseph: Detecting MySQL Replication Lag in HyperDB\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://josephscott.org/?p=4498\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://josephscott.org/archives/2011/07/detecting-mysql-replication-lag-in-hyperdb/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1809:\"<p>Iliya has a new post on <a href=\"http://barry.wordpress.com/2011/07/20/hyperdb-lag-detection/\">detecting MySQL replication lag in HyperDB</a>.  It starts off with a few <a href=\"http://wordpress.com/\">WordPress.com</a> numbers:</p>\n<blockquote><p>\nOn WordPress.com we have over 218 million tables and perform tens of thousands queries per second. To scale all of this, we shard our 24 million blogs across more than 550 MySQL servers. This allows us to cope with load bursts and to handle database servers failures.\n</p></blockquote>\n<p>The post goes on to describe some of the reasons why you might run into replication lag in MySQL and methods <a href=\"http://codex.wordpress.org/HyperDB\">HyperDB</a> uses to deal with that.  In the case of WordPress.com there are additional issues to consider, like replication across multiple datacenters.</p>\n<p>Something that HyperDB has had for awhile is the ability to force read queries back to the master if a write happened earlier on the same connection:</p>\n<blockquote><p>\nIf a connection modifies data in a given table, then all subsequent SELECTs on the same connection for that table are sent to the master. Chances are replication won’t be fast enough to propagate the changes to the slaves on the same page load.\n</p></blockquote>\n<p>This is a fairly simple technique than can be remarkably useful.</p>\n<p>You can find out more about HyperDB on the <a href=\"http://codex.wordpress.org/HyperDB\">HyperDB WordPress Codex page</a>, the <a href=\"http://wordpress.org/extend/plugins/hyperdb/\">HyperDB WordPress plugin page</a>, and the <a href=\"http://comox.textdrive.com/mailman/listinfo/hyperdb\">HyperDB mailing list</a>.  You can also grab a copy directly from the <a href=\"http://svn.wp-plugins.org/hyperdb/trunk/\">HyperDB Subversion repository</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2011 16:38:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Joseph Scott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Weblog Tools Collection: WordPress Theme Releases for 7/20\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10260\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/maGFOCgyYH4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:859:\"<p><img class=\"alignnone size-full wp-image-10261\" title=\"nest\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/nest.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><strong><a href=\"http://wordpress.org/extend/themes/nest\">Nest</a></strong> is a simple grey and white theme with theme options and widget support.</p>\n<p><img class=\"alignnone size-full wp-image-10262\" title=\"wptuts\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/wptuts.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://www.wpexplorer.com/wptuts-wordpress-theme.html\"><strong>WPTuts</strong></a> has a clean and modern design, post thumbnail support, homepage slider, custom menus, custom google fonts, built-in pagination, and more.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/maGFOCgyYH4\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2011 13:00:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"Weblog Tools Collection: Vote for your Favorite WordCamp Speakers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10255\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/d_pfjZxJDTg/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:816:\"<p><a href=\"http://2011.sf.wordcamp.org/\">WordCamp San Francisco</a>, the annual <a href=\"http://wordpress.org/\">WordPress</a> conference, will be here in just a few weeks. A few great speakers <a href=\"http://2011.sf.wordcamp.org/2011/07/17/a-dozen-more-speakers-announced/\">have already been chosen</a>, but the organizers are <a href=\"http://wordpress.org/news/2011/07/best-wordcamp-speakers/\">looking for a few good recommendations</a> from past WordCamp attendees.</p>\n<p>If you have attended a WordCamp in the past, <a href=\"http://wordcampcentral.polldaddy.com/s/best-2010-2011-wordcamp-speakers-so-far\">vote now</a> to nominate your favorite speakers for this year&#8217;s WordCamp San Francisco.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/d_pfjZxJDTg\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Jul 2011 13:00:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Alex King: Reminder: Post Formats are a Taxonomy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"http://alexking.org/?p=5968\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://alexking.org/blog/2011/07/18/reminder-post-formats-are-a-taxonomy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:336:\"<p>If you hook in to <code>get_the_terms</code> and try to make a <code>get_post_format()</code> call within your callback without first removing your filter, you&#8217;re going to get an infinite loop (perhaps a seg fault).</p>\n<p>Good times!</p>\n<img src=\"http://alexking.org/wp/?ak_action=api_record_view&id=5968&type=feed\" alt=\"\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jul 2011 21:50:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Matt: On Blue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38354\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"http://ma.tt/2011/07/on-blue/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1059:\"<div class=\"blockquote\"><blockquote><p>The world is blue at its edges and in its depths. This blue is the light that got lost. Light at the blue end of the spectrum does not travel the whole distance from the sun to us. It disperses among the molecules of the air, it scatters in water. Water is colorless, shallow water appears to be the color of whatever lies underneath it, but deep water is full of this scatted light, the purer the water the deeper the blue. The sky is blue for the same reason, but the blue at the horizon, the blue of land that seems to be disolving into the sky, is a deeper, dreamier, melancholy blue, the blue at the farthest reaches of the places where you see for miles, the blue of distance. This light that does not touch us, does not travel the whole distance, the light that gets lost, gives us the beauty of the world, so much of which is in the color blue.</p></blockquote></div>\n<p>From <a href=\"http://www.amazon.com/Field-Guide-Getting-Lost/dp/0143037242\"><em>A Field Guide to Getting Lost</em> by Rebecca Solnit</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jul 2011 17:29:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: Karma of Bug Killing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38352\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://ma.tt/2011/07/karma-of-bug-killing/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:207:\"<p><a href=\"http://publikworks.wordpress.com/2011/07/10/the-karma-of-bug-killing/\">The Karma of Bug Killing</a>. &#8220;We&#8217;re all pretty quick with the fly swatter and the folded newspapers.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jul 2011 16:54:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 7/18\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10253\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/SSjjZ-rYABE/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2352:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/count-shortcode/\"><strong>Count Shortcode</strong></a> is a shortcode to count number of posts that match a given set of criteria.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/faceted-search-widget/\"><strong>Faceted Search Widget</strong></a> allows filtering of any search results of archive (tag, category, year, month, etc.) by any built in (category, tag) or custom taxonomies.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/force-strong-passwords/\"><strong>Force Strong Passwords</strong></a> forces users with executive capabilities to use something strong when updating their passwords.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://www.artiss.co.uk/youtube-embed\"><strong>Artiss YouTube Embed</strong></a> is an incredibly simple, yet powerful, method of embedding YouTube videos into your WordPress site.</p>\n<p><a href=\"http://ocaoimh.ie/exploit-scanner/\"><strong>Exploit Scanner</strong></a> searches the files on your website, and the posts and comments tables of your database for anything suspicious. It also examines your list of active plugins for unusual filenames.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/theme-check/\"><strong>Theme-Check</strong></a> allows you to run checks on the current theme before uploading to WordPress. This plugin uses the same API and is kept more or less in sync with the WordPress.org uploader tool.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/ui-labs/\"><strong>UI Labs</strong></a> offers experimental WordPress admin UI features with the aim of building upon and enhancing the default WordPress User Interface. These are unofficial core UI experiments &#8211; who knows what could happen?</p>\n<p><a href=\"http://posttypemanager.wordpress.com/\"><strong>Ultimate Post Type Manager</strong></a> allows you to easily customize post types.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/wptouch/\"><strong>WPtouch</strong></a> automatically transforms your WordPress blog into an iPhone application-style theme, complete with ajax loading articles and effects, when viewed from an iPhone, iPod touch, Android, Opera Mini, Palm Pre, Samsung touch and BlackBerry Storm/Torch mobile devices.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/SSjjZ-rYABE\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jul 2011 13:00:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"Mark Jaquith: Speaking at WordCamp SF 2011\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"http://markjaquith.wordpress.com/?p=662\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://markjaquith.wordpress.com/2011/07/17/speaking-at-wordcamp-sf-2011/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4570:\"<p>My sessions for WordCamp San Francisco 2011 <a href=\"http://2011.sf.wordcamp.org/2011/07/16/mark-jaquith-confirmed-as-speaker/\">have been confirmed</a>. This post is a quick teaser. Please let me know if you have any questions on what will be covered, or if you have any suggestions:</p>\n<h3>Scaling, Servers, and Deploys — Oh My!</h3>\n<p>Alternate title: First Thing, Second Thing, and Oxford Commas — Em Dash! <img src=\"http://s0.wp.com/wp-includes/images/smilies/icon_smile.gif\" alt=\":-)\" class=\"wp-smiley\" /> </p>\n<p>If you manage professional WordPress-powered sites, this is going to be an invaluable presentation for you. If you&#8217;re a cowboy coder, this presentation is a mandatory WordPress-ordered intervention. (And if you don&#8217;t know what cowboy coding is, you probably do it, and don&#8217;t even know you need help.)</p>\n<p>I&#8217;ve worked with a lot of WordPress installations for professional sites in my client work. They inevitably fall short in some way. What is usually the case is that the people in charge of running the installation feel that instead of them having control of the environment, they are merely present in the environment. Deployments that were meant to be scalable are often somewhat less so, in practice. Tell me if this conversation sounds familiar:</p>\n<p>&#8220;What happens if we outgrow one server?&#8221;<br />\n&#8220;We&#8217;ll just add another one!&#8221;</p>\n<p>That&#8217;s easy to say as a hypothetical. But what if you actually had to do it? What if a couple hundred thousand unexpected page views started coming your way and your boss/client tells you &#8220;Go ahead and add that second server we&#8217;ve been talking about&#8230; how many minutes is that going to take?&#8221; Did you think &#8220;no sweat,&#8221; or did your heart start racing just imagining the scenario?</p>\n<p>I&#8217;m going to disclose the secret sauce. I&#8217;ll let you in on everything I&#8217;ve learned in the last seven years about how to code and architect WordPress-powered sites, how to scale up a single server, how to manage multiple servers, and how to deploy code in a way that is both responsive and prudent.</p>\n<p>Topics will include:</p>\n<ul>\n<li>Apache</li>\n<li>nginx</li>\n<li>Memcached</li>\n<li>MySQL</li>\n<li>APC</li>\n<li>NFS</li>\n<li>rsync</li>\n<li>Git</li>\n<li>Puppet</li>\n<li>Capistrano</li>\n</ul>\n<p>And more. At the end you&#8217;ll feel confident that you can run professional, fast, scalable WordPress installations that will make your job easier and your clients or boss happy.</p>\n<h3>Security Showdown</h3>\n<p>Instead of my battle-worn and (even to me) rather droll talk on WordPress security, I&#8217;m going to be doing an interactive panel with Brad Williams and Jon Cave. We&#8217;ll do live security reviews of some plugins that have been submitted ahead of time. This way, you can see WordPress security practices in action! There will be prizes and everything. Should be a bunch of fun.</p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/markjaquith.wordpress.com/662/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godelicious/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/delicious/markjaquith.wordpress.com/662/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gofacebook/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/facebook/markjaquith.wordpress.com/662/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gotwitter/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/twitter/markjaquith.wordpress.com/662/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gostumble/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/stumble/markjaquith.wordpress.com/662/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godigg/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/digg/markjaquith.wordpress.com/662/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/goreddit/markjaquith.wordpress.com/662/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/reddit/markjaquith.wordpress.com/662/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=markjaquith.wordpress.com&blog=316&post=662&subd=markjaquith&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jul 2011 03:24:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mark Jaquith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Dev Blog: Best WordCamp Speakers?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=2000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"http://wordpress.org/news/2011/07/best-wordcamp-speakers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1599:\"<p>As we complete speaker selection for <a href=\"http://2011.sf.wordcamp.org/\">the annual WordPress conference (a.k.a. WordCamp San Francisco)</a>, it&#8217;s clear that even though there were more than 200 speaker applications, many great WordCamp speakers did not apply. No fear! We will seek them out to make sure that WordCamp SF has a fantastic lineup, including people who didn&#8217;t apply (too shy? who knows?) but have wowed local crowds at previous WordCamps.</p>\n<p>This is about as basic a survey as there is. Tell us the three best WordCamp presentations you saw in the past year or so. For each, give the presenters name, the topic (exact title not necessary) and which WordCamp it was at (important).</p>\n<p>Example:</p>\n<p>1. Joe Shmoe, Using the Loop, WordCamp Sheboygan 2011<br />\n2. Jane Doe, Top 5 WordPress Plugins, WordCamp La Mancha 2010<br />\n3. Lee Smith, Your First Core Patch, WordCamp Atlantis 2011</p>\n<p>That&#8217;s it. We don&#8217;t need your name or any info at all, just your three top speaker votes. We&#8217;ll take a look at the people with the most votes, and consider them for WCSF if they&#8217;re not already in the application pool. Thanks for your help in making this year&#8217;s conference better and more WordPressy than ever. <img src=\"http://wordpress.org/news/wp-includes/images/smilies/icon_smile.gif\" alt=\":)\" class=\"wp-smiley\" /> </p>\n<p><a href=\"http://wordcampcentral.polldaddy.com/s/best-2010-2011-wordcamp-speakers-so-far\">Vote Now!</a></p>\n<p>P.S. <a href=\"http://2011.sf.wordcamp.org/get-tickets/\">Have you bought your tickets yet</a>?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Jul 2011 21:32:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Jane Wells\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Weblog Tools Collection: WordPress Theme Releases for 7/16\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10245\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/l0nF_ERhebY/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:792:\"<p><img class=\"alignnone size-full wp-image-10246\" title=\"coaster\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/coaster.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://wordpress.org/extend/themes/coaster\"><strong>Coaster</strong></a> is a blue and orange two-column theme.</p>\n<p><img class=\"alignnone size-full wp-image-10247\" title=\"gardenexplosion\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/gardenexplosion.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://emptynestthemes.emptynestheritage.com/?p=2213\"><strong>Garden Explosion</strong></a> is a 3 column theme in vivid greens, yellows, pinks and oranges.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/l0nF_ERhebY\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Jul 2011 13:00:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"Dougal Campbell: Review: WordPress 3 Plugin Development Essentials\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://dougal.gunters.org/?p=55041\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://dougal.gunters.org/blog/2011/07/14/review-wordpress-3-plugin-development-essentials/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12355:\"<div class=\"alignright\"></div>\n<p>I recently received a copy of <a href=\"http://www.amazon.com/gp/product/184951352X/ref=as_li_ss_tl?ie=UTF8&tag=geekramblings-20&linkCode=as2&camp=217145&creative=399373&creativeASIN=184951352X\">WordPress 3 Plugin Development Essentials</a><img src=\"http://www.assoc-amazon.com/e/ir?t=geekramblings-20&l=as2&o=1&a=184951352X&camp=217145&creative=399373\" alt=\"\" width=\"1\" height=\"1\" border=\"0\" /> from Packt Publishing. This book was authored by Brian Bondari and Everett Griffiths, who run the <a href=\"http://tipsfor.us/\">TipsFor.us</a> site together. I also noted that one of the technical editors was Paul Thewlis, who wrote <a title=\"Book Review: WordPress for Business Bloggers\" href=\"http://dougal.gunters.org/blog/2008/11/12/book-review-wordpress-for-business-bloggers/\">WordPress for Business Bloggers</a>, which I reviewed here previously.</p>\n<p>I&#8217;m always eager to check out new programming books that come my way, and that&#8217;s especially true for books that cover WordPress plugins. There are certain styles for programming books that you come to recognize &#8212; a sort of Pattern. And there are particular patterns that annoy me a little. But this book does not use those patterns, so it was refreshing to see a teaching approach that I actually like. I have to say that overall I&#8217;m pleased with this one, though there were a couple of negatives that jumped out at me a little. But first, let&#8217;s cover the good points.</p>\n<p><span id=\"more-55041\"></span>The first chapter of WordPress 3 Plugin Development Essentials is pretty typical stuff for a development book. It covers some basic information about how to get a web development stack for your computer (MAMP, <acronym title=\"Microsoft, Apache, MySQL, Php\"><span class=\"caps\">WAMP</span></acronym>, XAMPP, Microsoft Web Platform, etc.), text editors and IDEs, etc. You&#8217;ll also find brief descriptions of WordPress, what plugins are, some information about source control and debugging, and a few other tidbits.</p>\n<p>Chapter 2 is where the meat begins. <a href=\"http://ma.tt/\">Matt Mullenweg</a> will appreciate that this book begins with a dissection of the infamous <a href=\"http://wordpress.org/extend/plugins/hello-dolly/\">Hello Dolly plugin</a>. The authors use the existing plugin code to illustrate the core concepts of a plugin: the information header, user-defined functions, and WordPress <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym> hooks. But what I <em>really</em> liked about this first chapter is that the first exercise for the reader is to break the plugin. In fact, they have you break the plugin in several different ways, each illustrating different ways that you might encounter problems when developing your own plugin code.</p>\n<p>First, they have you remove the plugin header, and observe how WordPress will notify about automatically deactivating the plugin. Then they have you insert gibberish into the plugin to show what happens when a fatal syntax error occurs. Then they have you send output to the browser without going through WordPress hooks, showing the <acronym title=\"Php Hypertext Processor\"><span class=\"caps\">PHP</span></acronym> warning about sending output before HTTP headers are sent. And they also show the result of having whitespace occur after the final <acronym title=\"Php Hypertext Processor\"><span class=\"caps\">PHP</span></acronym> closing <code>?&gt;</code> tag, and how it is safe to omit it to avoid the error. And, of course, they also go through modifying Hello Dolly by changing which hooks it calls, so that it sends output to post content on the front page, instead of in the admin pages.</p>\n<p>I thought that this was an excellent way to start the process. Too often, programming books give you the canonical &#8220;<a href=\"http://www.roesler-ac.de/wolfram/hello.htm\">Hello, World</a>&#8221; example, which doesn&#8217;t do much for you in the way of learning something new. In this case, they take an existing variation of Hello, World, and show you how changing various pieces of it affect WordPress or how the plugin itself operates. Exposing the reader to errors deliberately, and explaining why they happened, will help the user understand and recover from errors later on, when they happen accidentally. Kudos for that!</p>\n<p>The next chapter goes more in-depth, creating a &#8220;Digg This&#8221; plugin from scratch. This task is simple enough to understand pretty easily, while covering key concepts which help the reader become more familiar with several important WordPress functions and hooks. This process covers fetching a post&#8217;s title, content, categories and <acronym title=\"Uniform Resource Locator\"><span class=\"caps\">URL</span></acronym>, as well as inserting Javascript into the page head. They start by creating an empty skeleton with stub functions for each method the plugin needs, and fill in the functions one-by-one, explaining its purpose.</p>\n<p>I won&#8217;t detail every chapter, but here&#8217;s a quick synopsis:</p>\n<ol>\n<li><strong>Preparing for WordPress Development</strong>, an introduction to WordPress and setting up a development environment</li>\n<li><strong>Anatomy of a Plugin</strong>, using Hello Dolly as an example</li>\n<li><strong>Social Bookmarking</strong>, building a Digg This button plugin</li>\n<li><strong>Ajax Search</strong> plugin, implementing &#8220;live search&#8221; using jQuery, and introducing using <acronym title=\"Php Hypertext Processor\"><span class=\"caps\">PHP</span></acronym> classes to encapsulate plugin functions</li>\n<li><strong>Content Rotator</strong> plugin, covers extending the WP_Widget class and adding a custom plugin settings page</li>\n<li><strong>Standardized Custom Content</strong>, working with Custom Fields (post meta), custom meta boxes, creating and modifying a child theme</li>\n<li><strong>Custom Post Types</strong>, working with Custom Post Types, using the Shortcode <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym>, adding a settings shortcut link to the plugins page, plugin uninstall handling</li>\n<li><strong>Versioning Your Code with Subversion (SVN)</strong>, introduction to using svn to manage your code revisions</li>\n<li><strong>Preparing Your Plugin for Distribution</strong>, cleaning up your code, testing</li>\n<li><strong>Publishing Your Plugin</strong>, internationalization and localization, readme.txt file format, submitting your plugin to the wordpress.org repository</li>\n</ol>\n<p>There are also two appendices. The first is a list of helpful online resources such as the <acronym title=\"Php Hypertext Processor\"><span class=\"caps\">PHP</span></acronym> documentation site, the WordPress Codex, and a handful of other WordPress and web development sites. Appendix B is a list of WordPress <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym> functions used in the book, with a brief description of their usage.</p>\n<p>While overall I felt like this book takes a good approach and paces things well, I do have a couple of nits to pick, particularly with chapters 4 and 5. When publishing a book like this, I feel it is very important to educate the reader using best practices. Sometimes you might need to illustrate &#8220;dirty&#8221; ways of doing things to make a point, or to ease readers into a complex subject, but you should always point out best practices. For the most part, this book did a pretty good job of that, and I was pleased to see some discussion of important topics like escaping data to avoid cross-site scripting problems and other similar security risks, for example. But in the discussions of Ajax and creating plugin option pages, they fell down a bit.</p>\n<p>First, while I felt like a live search plugin was a useful example to use for discussing Ajax, I was disappointed to see that the authors did not use the built-in <a href=\"http://codex.wordpress.org/AJAX_in_Plugins\">WordPress <acronym title=\"Asynchronous Javascript and XML\"><span class=\"caps\">AJAX</span></acronym> APIs</a> for this. The <code>wp_ajax_*</code> and <code>wp_ajax_nopriv_*</code> functions really make this fairly easy, once you wrap your head around it.</p>\n<p>And second, the examples of creating option pages did not take advantage of the <a href=\"http://codex.wordpress.org/Settings_API\">Settings <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym></a>. Using this <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym> has several advantages over building your own form manually: It automatically handles security nonces for you, it automatically handles saving options to the database as a serialized array, it lets you create a validation callback function to error-check the data, it gives your options page user interface consistency with the standard WordPress admin, and it future-proofs your options page against changes to the standard <acronym title=\"User Interface\"><span class=\"caps\">UI</span></acronym>. I&#8217;d also recommend checking out <a href=\"http://ottopress.com/2009/wordpress-settings-api-tutorial/\">Otto&#8217;s Settings <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym> Tutorial</a> for some clear examples.</p>\n<p>Other than those two exceptions, I felt like this book provided useful examples which gently introduce the reader to important WordPress plugin <acronym title=\"Application Interface\"><span class=\"caps\">API</span></acronym> concepts. As the book progresses, it builds upon concepts learned previously, while providing a variety of individual example plugin projects. This is another point that I really liked &#8212; variety. I don&#8217;t like books that take the approach of building a single, large application (&#8220;<em>let&#8217;s build a shopping cart!</em>&#8221; or &#8220;<em>let&#8217;s build a product catalog site!</em>&#8220;). By building several stand-alone plugins to illustrate each chapter&#8217;s concepts, the reader is more likely to find something that piques their interest, and it becomes more digestible.</p>\n<p>You can get more details and download a sample chapter (Chapter 5: Content Rotator) <a href=\"http://www.packtpub.com/wordpress-3-plugin-development-essentials/book\">from the Packt Publishing site</a>. Or, <a href=\"http://www.amazon.com/gp/product/184951352X/ref=as_li_ss_tl?ie=UTF8&tag=geekramblings-20&linkCode=as2&camp=217145&creative=399373&creativeASIN=184951352X\">Buy from Amazon.com</a><img src=\"http://www.assoc-amazon.com/e/ir?t=geekramblings-20&l=as2&o=1&a=184951352X&camp=217145&creative=399373\" alt=\"\" width=\"1\" height=\"1\" border=\"0\" />.</p>\n<div class=\"az_easel\"><div class=\"item\"><h4><a href=\"http://www.amazon.com/WordPress-3-Plugin-Development-Essentials/dp/184951352X%3FSubscriptionId%3D1JJ18DJ28VQQA17AG7R2%26tag%3Dgeekramblings-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3D184951352X\">WordPress 3 Plugin Development Essentials</a></h4><div class=\"byline\">Paperback, Brian Bondari, Everett Griffiths</div><a href=\"http://www.amazon.com/WordPress-3-Plugin-Development-Essentials/dp/184951352X%3FSubscriptionId%3D1JJ18DJ28VQQA17AG7R2%26tag%3Dgeekramblings-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3D184951352X\"><img src=\"http://ecx.images-amazon.com/images/I/51WPwzcqncL._SL160_.jpg\" class=\"book\" alt=\"WordPress 3 Plugin Development Essentials\" /></a><ul class=\"prices\"><li class=\"d\">$39.99 List Price</li><li><a href=\"http://www.amazon.com/WordPress-3-Plugin-Development-Essentials/dp/184951352X%3FSubscriptionId%3D1JJ18DJ28VQQA17AG7R2%26tag%3Dgeekramblings-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3D184951352X\" title=\"Buy: WordPress 3 Plugin Development Essentials\">$34.35 at Amazon.com</a></li></ul><div class=\"info\"><h4>Other versions</h4><a href=\"http://www.amazon.com/exec/obidos/ASIN/B005685F6U/ref=nosim/geekramblings-20\">WordPress 3 Plugin Development Essentials, Kindle Edition</a></div></div></div>\n<p>Disclosure: Amazon product links are affiliate links, which provide a small sales commission to me, and help support this site. Packt Publishing provided me with a free copy of this book to review, but I make every effort to keep my reviews unbiased and honest.</p>\n<p>&nbsp;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 Jul 2011 03:31:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Dougal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Matt: The Software is Wrong, Not the People\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38350\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"http://ma.tt/2011/07/the-software-is-wrong-not-the-people/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:195:\"<p><a href=\"http://joeflood.com/2011/07/13/the-software-is-wrong-not-the-people/#.Th2i-IZlYcE.tweet\">The Software is Wrong, Not the People by Joe Flood</a> about the DC meetup the other day.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 14 Jul 2011 23:00:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Plugin Releases for 7/14\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10243\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/NXsm2di1EWA/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1153:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/custom-wp-update-message/\"><strong>Custom WP Update Message</strong></a> allows you to customize the WordPress update message shown when a new version of WordPress is available.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/tumblr-importer/\"><strong>Tumblr Importer</strong></a> allows you to import posts from a Tumblr blog.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/dukapress/\"><strong>DukaPress</strong></a> is an open source and free to use e-commerce platform.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/hotfix/\"><strong>Hotfix</strong></a> provides unofficial fixes for selected WordPress bugs, so you don&#8217;t have to wait for the next WordPress core release.</p>\n<p><a href=\"http://www.designchemical.com/blog/index.php/wordpress-plugin-slick-contact-forms/\"><strong>Slick Contact Forms</strong></a> creates a widget, which adds a contact form using either a floating, drop down button or a sticky, sliding tab.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/NXsm2di1EWA\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 14 Jul 2011 13:00:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Weblog Tools Collection: WordPress 3.2.1 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10240\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/jGTTLfuxsB4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:719:\"<p><a href=\"http://wordpress.org/\">WordPress</a> 3.2.1 <a href=\"http://wordpress.org/news/2011/07/wordpress-3-2-1/\">has been released</a>. This quick maintenance release fixes a minor JSON-related server incompatibility that only affected a few users and adds <a href=\"http://core.trac.wordpress.org/log/branches/3.2/?rev=18436&stop_rev=18398\">a few finishing touches</a> to the new Dashboard and Twenty Eleven theme.</p>\n<p>This is the first release to make use of the new update system, which only replaces changes files, so you should notice a much quicker process compared to previous automated updates.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/jGTTLfuxsB4\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Jul 2011 13:00:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Dev Blog: WordPress 3.2.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=1982\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"http://wordpress.org/news/2011/07/wordpress-3-2-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1116:\"<p>After more than a million downloads of WordPress 3.2, we&#8217;re now releasing <a href=\"http://wordpress.org/download/\">WordPress 3.2.1</a> into the wild. This maintenance release fixes a server incompatibility related to JSON that&#8217;s unfortunately affected some of you, as well as a few other fixes in the new dashboard design and the Twenty Eleven theme. If you&#8217;ve already updated to 3.2, then this update will be even faster than usual, thanks to the new feature in 3.2 that only updates files that have been changed, rather than replacing all the files in your installation.</p>\n<p>For a full list of fixes, view the <a href=\"http://core.trac.wordpress.org/log/branches/3.2/?rev=18436&stop_rev=18398\">changelog</a> the list of <a href=\"http://core.trac.wordpress.org/query?status=closed&group=resolution&milestone=3.2.1\">tickets</a>. Our release haiku:</p>\n<p>JSON, the admin<br />\nA little bit tidier<br />\nEdge cases covered</p>\n<p><a href=\"http://wordpress.org/download/\"><strong>Download 3.2.1</strong></a> or update now from the Dashboard → Updates menu in your site&#8217;s admin area.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jul 2011 19:49:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Andrew Nacin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Gravatar: Open Profile Data\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.gravatar.com/?p=229\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://blog.gravatar.com/2011/07/12/open-profile-data/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3394:\"<p>Did you know that in addition to the <a href=\"http://blog.gravatar.com/2010/06/22/hcard-profile-pages/\">hCard markup</a> on <a href=\"http://blog.gravatar.com/2010/06/02/public-profiles-for-everyone/\">profile pages</a>, we support a number of other completely open, standards-based formats for accessing profile data on Gravatar? These formats are all accessed using a similar method to how Gravatar images have been requested. <a href=\"http://gravatar.com/site/implement/profiles/\">Full details are provided</a> in the <a href=\"http://gravatar.com/site/implement/\">Developer Resources section</a> of the site which has been completely refreshed! Here are the formats that are available:</p>\n<ul>\n<li>JSON</li>\n<li>XML</li>\n<li>PHP</li>\n<li>VCF/vCard</li>\n<li>QR Codes</li>\n</ul>\n<p>The raw data formats (JSON, XML, PHP) are based on the <a href=\"http://portablecontacts.net/\">Portable Contacts</a> standard to improve interoperability with existing tools and systems, while the other formats are existing standards for sharing certain pieces of data. We&#8217;ll be providing some example implementations to demonstrate just how powerful these options can be, and I&#8217;m sure that we&#8217;ll start seeing some creative implementations from folks in the near future.</p>\n<p>Here was the initial announcement around the coming profile data formats which I made at WordCamp San Francisco 2010 in May. You can also view the video on <a href=\"http://wordpress.tv/2010/05/01/beau-lebens-gravatar-profiles-sf10/\">WordPress.tv</a>.</p>\n<p><div id=\"v-ZFGDUW6i\" class=\"video-player\">\n</div></p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/gravatar.wordpress.com/229/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godelicious/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/delicious/gravatar.wordpress.com/229/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gofacebook/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/facebook/gravatar.wordpress.com/229/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gotwitter/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/twitter/gravatar.wordpress.com/229/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gostumble/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/stumble/gravatar.wordpress.com/229/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/godigg/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/digg/gravatar.wordpress.com/229/\" /></a> <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/goreddit/gravatar.wordpress.com/229/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/reddit/gravatar.wordpress.com/229/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=blog.gravatar.com&blog=1886259&post=229&subd=gravatar&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://blog.gravatar.com/2011/07/12/open-profile-data/\"><img alt=\"Beau Lebens &#8211; Gravatar Open Profiles\" src=\"http://videos.videopress.com/ZFGDUW6i/beau-lebens-gravatar-public-profiles_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jul 2011 18:19:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Beau Lebens\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Matt: FCC.gov’s First Contribution\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=38348\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"http://ma.tt/2011/07/fcc-gov%e2%80%99s-first-contribution/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:408:\"<p><a href=\"http://www.fcc.gov/blog/contributing-code-back-fcc-govs-open-source-feedback-loop\">The FCC just released their first plugin for WordPress (a faceted search widget) and writes about why</a>. Does your organization have a cool plugin you&#8217;ve written but not released yet? I know we do. Hopefully they will get the plugin <a href=\"http://wordpress.org/extend/plugins/\">in the repo soon</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jul 2011 16:21:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Weblog Tools Collection: WordPress Theme Releases for 7/12\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=10234\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/Nx_QKbQnn3k/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1154:\"<p><img class=\"alignnone size-full wp-image-10235\" title=\"newsleak\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/newsleak.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://wordpress.org/extend/themes/news-leak\"><strong>News Leak</strong></a> is designed to give the website a professional look with ready to use Social networking support.</p>\n<p><img class=\"alignnone size-full wp-image-10236\" title=\"rosey\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/rosey.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://emptynestthemes.emptynestheritage.com/?p=1810\"><strong>Rosey</strong></a> invokes a peaceful, soft, and warm mood.</p>\n<p><img class=\"alignnone size-full wp-image-10237\" title=\"tweaker4\" src=\"http://weblogtoolscollection.com/wp-content/uploads/2011/07/tweaker4.jpg\" alt=\"\" width=\"150\" height=\"113\" /></p>\n<p><a href=\"http://wordpress.org/extend/themes/tweaker4\"><strong>Tweaker4</strong></a> is a theme specifically built for those who love tweaking their own themes.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/Nx_QKbQnn3k\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jul 2011 13:00:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"James Huff\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Donncha: Get a sneak preview of WP Super Cache before 1.0!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://ocaoimh.cuteandinsane.com/?p=89496354\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"http://ocaoimh.ie/2011/07/11/get-a-sneak-preview-of-wp-super-cache-before-1-0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3181:\"<p>WP Super Cache 1.0 will be out soon(ish) but I need testers to bang on the development version available on the <a href=\"http://wordpress.org/extend/plugins/wp-super-cache/download/\">download page</a>.</p>\n<p>This version should be significantly faster if you have a lot of mobile visitors, plus it adds support for https secure pages. The speed came about by saving those files as static files in the supercache directories rather than the old &#8220;legacy caching&#8221; of WP Cache. You&#8217;ll see files like index-mobile.html(.gz) and index-https.html(.gz) in those directories. Be aware that if you use a flat permalink structure the plugin opens the root supercache directory for reading to find the index* files. This may or may not be an issue with directories containing a very large number of directories (10,000+ for example). </p>\n<p>HTTPS support is built into the mod_rewrite rules so those files are served by the web server directly, but PHP serves the mobile clients. Only now you&#8217;ll be able to cache many times more mobile pages than before. There&#8217;s negligible speed difference between PHP and mod_rewrite modes anyway in normal operation.</p>\n<p>There&#8217;s also a handy little &#8220;donotcachepage&#8221; GET parameter now. Add that, giving it the value of a secret key from the Advanced settings page and the current page will not be cached in any way.</p>\n<p>There is lots of new code in the plugin. It&#8217;s running fine here, and a few other people have had no problems but I need more feedback. If you have a development server please give this a go, and if it works ok I believe it&#8217;s good enough to go live, <em>under supervision</em>. Don&#8217;t go install it on a Friday afternoon&#8230;</p>\n<p>With the upgrade to WordPress 3.2 I moved this site and my <a href=\"http://inphotos.org/\">photoblog</a> to a Multisite install so I&#8217;ve been looking at making Supercache work better in that environment too. </p>\n<p>I also installed Varnish as a front end cache and woah, I&#8217;m impressed. Setup was fairly easy though it&#8217;s still not 100% right. When I make posts the following page is a blank page except for the blog title, and when I (as a logged in user) leave a comment I get a 500 error and wp-comments-post.php doesn&#8217;t redirect. I&#8217;m still trying to debug those issues. I mentioned this on <a href=\"https://plus.google.com/106437496932759928522/posts/QMfyoD5AAzZ\">Google Plus</a> a few days ago but expect a follow up post on Varnish with docs in the near future. </p>\n<p>Now all I need is traffic. I should blog more!</p>\n\n<p><strong>Related Posts</strong><ul><li> <a href=\"http://ocaoimh.ie/2008/10/24/wp-super-cache-084-the-garbage-collector/\" rel=\"bookmark\" title=\"Permanent Link: WP Super Cache 0.8.4, the garbage collector\">WP Super Cache 0.8.4, the garbage collector</a></li><li> <a href=\"http://ocaoimh.ie/2009/01/09/wp-super-cache-087/\" rel=\"bookmark\" title=\"Permanent Link: WP Super Cache 0.8.7\">WP Super Cache 0.8.7</a></li><li> <a href=\"http://ocaoimh.ie/2010/02/08/wp-super-cache-099/\" rel=\"bookmark\" title=\"Permanent Link: WP Super Cache 0.9.9\">WP Super Cache 0.9.9</a></li></ul></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 11 Jul 2011 21:37:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Donncha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:9:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Mon, 01 Aug 2011 21:21:37 GMT\";s:12:\"content-type\";s:15:\"application/xml\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Mon, 01 Aug 2011 21:15:23 GMT\";s:14:\"content-length\";s:6:\"168778\";s:4:\"x-nc\";s:11:\"HIT luv 138\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20090627192103\";}', 'no');
