:0;a:5:{s:4:\"data\";s:23:\"Best WordCamp Speakers?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"http://wordpress.org/news/2011/07/best-wordcamp-speakers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"http://wordpress.org/news/2011/07/best-wordcamp-speakers/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Jul 2011 21:32:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:9:\"Community\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"WordCamp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=2000\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:357:\"As we complete speaker selection for the annual WordPress conference (a.k.a. WordCamp San Francisco), it&#8217;s clear that even though there were more than 200 speaker applications, many great WordCamp speakers did not apply. No fear! We will seek them out to make sure that WordCamp SF has a fantastic lineup, including people who didn&#8217;t apply [...]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Jane Wells\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1600:\"<p>As we complete speaker selection for <a href=\"http://2011.sf.wordcamp.org/\">the annual WordPress conference (a.k.a. WordCamp San Francisco)</a>, it&#8217;s clear that even though there were more than 200 speaker applications, many great WordCamp speakers did not apply. No fear! We will seek them out to make sure that WordCamp SF has a fantastic lineup, including people who didn&#8217;t apply (too shy? who knows?) but have wowed local crowds at previous WordCamps.</p>\n<p>This is about as basic a survey as there is. Tell us the three best WordCamp presentations you saw in the past year or so. For each, give the presenters name, the topic (exact title not necessary) and which WordCamp it was at (important).</p>\n<p>Example:</p>\n<p>1. Joe Shmoe, Using the Loop, WordCamp Sheboygan 2011<br />\n2. Jane Doe, Top 5 WordPress Plugins, WordCamp La Mancha 2010<br />\n3. Lee Smith, Your First Core Patch, WordCamp Atlantis 2011</p>\n<p>That&#8217;s it. We don&#8217;t need your name or any info at all, just your three top speaker votes. We&#8217;ll take a look at the people with the most votes, and consider them for WCSF if they&#8217;re not already in the application pool. Thanks for your help in making this year&#8217;s conference better and more WordPressy than ever. <img src=\'http://wordpress.org/news/wp-includes/images/smilies/icon_smile.gif\' alt=\':)\' class=\'wp-smiley\' /> </p>\n<p><a href=\"http://wordcampcentral.polldaddy.com/s/best-2010-2011-wordcamp-speakers-so-far\">Vote Now!</a></p>\n<p>P.S. <a href=\"http://2011.sf.wordcamp.org/get-tickets/\">Have you bought your tickets yet</a>?</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wordpress.org/news/2011/07/best-wordcamp-speakers/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:41:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"WordPress 3.2.1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"http://wordpress.org/news/2011/07/wordpress-3-2-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://wordpress.org/news/2011/07/wordpress-3-2-1/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jul 2011 19:49:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=1982\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:358:\"After more than a million downloads of WordPress 3.2, we&#8217;re now releasing WordPress 3.2.1 into the wild. This maintenance release fixes a server incompatibility related to JSON that&#8217;s unfortunately affected some of you, as well as a few other fixes in the new dashboard design and the Twenty Eleven theme. If you&#8217;ve already updated to [...]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Andrew Nacin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1129:\"<p>After more than a million downloads of WordPress 3.2, we&#8217;re now releasing <a href=\"http://wordpress.org/download/\">WordPress 3.2.1</a> into the wild. This maintenance release fixes a server incompatibility related to JSON that&#8217;s unfortunately affected some of you, as well as a few other fixes in the new dashboard design and the Twenty Eleven theme. If you&#8217;ve already updated to 3.2, then this update will be even faster than usual, thanks to the new feature in 3.2 that only updates files that have been changed, rather than replacing all the files in your installation.</p>\n<p>For a full list of fixes, view the <a href=\"http://core.trac.wordpress.org/log/branches/3.2/?rev=18436&amp;stop_rev=18398\">changelog</a> the list of <a href=\"http://core.trac.wordpress.org/query?status=closed&amp;group=resolution&amp;milestone=3.2.1\">tickets</a>. Our release haiku:</p>\n<p>JSON, the admin<br />\nA little bit tidier<br />\nEdge cases covered</p>\n<p><a href=\"http://wordpress.org/download/\"><strong>Download 3.2.1</strong></a> or update now from the Dashboard → Updates menu in your site&#8217;s admin area.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://wordpress.org/news/2011/07/wordpress-3-2-1/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:41:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n			\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"WordPress 3.2 now available\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"http://wordpress.org/news/2011/07/gershwin/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://wordpress.org/news/2011/07/gershwin/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Jul 2011 21:07:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=1924\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:329:\"Here in the U.S. we are observing Independence Day, and I can&#8217;t think of a more fitting way to mark a day that celebrates freedom than by releasing more free software to help democratize publishing around the globe. I&#8217;m excited to announce that WordPress 3.2 is now available to the world, both as an update in [...]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:14127:\"<p>Here in the U.S. we are observing Independence Day, and I can&#8217;t think of a more fitting way to mark a day that celebrates freedom than by releasing more free software to help democratize publishing around the globe. I&#8217;m excited to announce that WordPress 3.2 is now available to the world, both as an update in your dashboard and a <a href=\"http://wordpress.org/\">download on WordPress.org</a>. Version 3.2 is our fifteenth major release of WordPress and comes just four months after 3.1 (which coincidentally just passed the 15 million download mark this morning), reflecting the growing speed of development in the WordPress community and our dedication to getting improvements in your hands as soon as possible. We&#8217;re dedicating this release to noted composer and pianist <a href=\"http://en.wikipedia.org/wiki/George_Gershwin\">George Gershwin</a>.</p>\n<p><em>Before we get to the release, in anticipation of the State of the Word speech at the upcoming <a href=\"http://2011.sf.wordcamp.org/\">WordCamp San Francisco</a> (the annual WordPress conference) we&#8217;re doing a survey or census of the WordPress world. If you have a moment, <a href=\"http://wpsurvey.polldaddy.com/s/wp-2011\">please fill out this survey</a> and we&#8217;ll share what <em>we learn by </em>publishing the aggregate results in August.</em></p>\n<p>The focus for this release was <strong>making WordPress faster and lighter</strong>. The first thing you&#8217;ll notice when you log in to 3.2 is a <strong>refreshed dashboard design</strong> that tightens the typography, design, and code behind the admin. (Rhapsody in Grey?) If you&#8217;re starting a new blog, you&#8217;ll also appreciate the fully HTML5 <strong>new Twenty Eleven theme</strong>, fulfilling our plan to replace the default theme every year. Start writing your first post in our redesigned post editor and venture to the full-screen button in the editing toolbar to enter the new <strong>distraction-free writing or zen mode</strong>, my personal favorite feature of the release. All of the widgets, menus, buttons, and interface elements fade away to allow you to compose and edit your thoughts in a completely clean environment conducive to writing, but when your mouse strays to the top of the screen your most-used shortcuts are right there where you need them. (I like to press F11 to take my browser full-screen, getting rid of even the OS chrome.)</p>\n<p><embed src=\"http://v.wordpress.com/ac07H291\" type=\"application/x-shockwave-flash\" width=\"600\" height=\"337\" allowscriptaccess=\"always\" allowfullscreen=\"true\" wmode=\"transparent\"></embed></p>\n<p>Under the hood there have been a number of improvements, not the least of which is the <strong>streamlining</strong> enabled by our <a href=\"http://wordpress.org/news/2010/07/eol-for-php4-and-mysql4/\">previously announced plan</a> of retiring support for PHP4, older versions of MySQL, and legacy browsers like IE6, which allows us to take advantage of more features enabled by new technologies. The <strong>admin bar</strong> has a few more shortcuts to your most commonly-used actions. On the comment moderation screen, the new <strong>approve &amp; reply</strong> feature speeds up your conversation management. You&#8217;ll notice in your first update after 3.2 that we&#8217;ll only be updating the files that have changed with each new release instead of every file in your WordPress installation, which makes <strong>updates significantly faster on all hosting platforms</strong>. There are also some fun new theme features shown off by Twenty Eleven, like the ability to have multiple <strong>rotating header images</strong> to highlight all of your favorite photos.</p>\n<p>There is way more, like our new freedoms and credits screens (linked from your dashboard footer), so for the full story check out the <a href=\"http://codex.wordpress.org/Version_3.2\">Codex page on 3.2</a> or the <a href=\"http://core.trac.wordpress.org/milestone/3.2\">Trac milestone which includes the 400+ tickets closed in this release</a>.</p>\n<h3>A Community Effort</h3>\n<p>We now finally have a credits page inside of WordPress itself (though a cool revision is coming in 3.3), but for posterity let&#8217;s give a round of applause to these fine folks who contributed to 3.2:</p>\n<p><a href=\"http://profiles.wordpress.org/users/technosailor\">Aaron Brazell</a>, <a href=\"http://profiles.wordpress.org/users/aaroncampbell\">Aaron Campbell</a>, <a href=\"http://profiles.wordpress.org/users/jorbin\">Aaron Jorbin</a>, <a href=\"http://profiles.wordpress.org/users/kawauso\">Adam Harley</a>, <a href=\"http://profiles.wordpress.org/users/xknown\">Alex Concha</a>, <a href=\"http://profiles.wordpress.org/users/ampt\">ampt</a>, <a href=\"http://profiles.wordpress.org/users/nacin\">Andrew Nacin</a>, <a href=\"http://profiles.wordpress.org/users/azaozz\">Andrew Ozz</a>, <a href=\"http://profiles.wordpress.org/users/andrewryno\">andrewryno</a>, <a href=\"http://profiles.wordpress.org/users/andy\">andy</a>, <a href=\"http://profiles.wordpress.org/users/filosofo\">Austin Matzko</a>, <a href=\"http://profiles.wordpress.org/users/benchapman\">BenChapman</a>, <a href=\"http://profiles.wordpress.org/users/empireoflight\">Ben Dunkle</a>, <a href=\"http://profiles.wordpress.org/users/bluntelk\">bluntelk</a>, <a href=\"http://profiles.wordpress.org/users/boonebgorges\">Boone Gorges</a>, <a href=\"http://profiles.wordpress.org/users/cnorris23\">Brandon Allen</a>, <a href=\"http://profiles.wordpress.org/users/brandonburke\">Brandon Burke</a>, <a href=\"http://profiles.wordpress.org/users/caspie\">Caspie</a>, <a href=\"http://profiles.wordpress.org/users/cfinke\">cfinke</a>, <a href=\"http://profiles.wordpress.org/users/charlesclarkson\">charlesclarkson</a>, <a href=\"http://profiles.wordpress.org/users/chexee\">chexee</a>, <a href=\"http://profiles.wordpress.org/users/coffee2code\">coffee2code</a>, <a href=\"http://profiles.wordpress.org/users/scribu\">Cristi Burcă</a>, <a href=\"http://profiles.wordpress.org/users/daniloercoli\">daniloercoli</a>, <a href=\"http://profiles.wordpress.org/users/koopersmith\">Daryl Koopersmith</a>, <a href=\"http://profiles.wordpress.org/users/dcowgill\">David Cowgill</a>, <a href=\"http://profiles.wordpress.org/users/jdtrower\">David Trower</a>, <a href=\"http://profiles.wordpress.org/users/demetris\">demetris</a>, <a href=\"http://profiles.wordpress.org/users/devinreams\">Devin Reams</a>, <a href=\"http://profiles.wordpress.org/users/dd32\">Dion Hulse</a>, <a href=\"http://profiles.wordpress.org/users/dllh\">dllh</a>, <a href=\"http://profiles.wordpress.org/users/ocean90\">Dominik Schilling</a>, <a href=\"http://profiles.wordpress.org/users/dougwrites\">Doug Provencio</a>, <a href=\"http://profiles.wordpress.org/users/dvwallin\">dvwallin</a>, <a href=\"http://profiles.wordpress.org/users/cyberhobo\">Dylan Kuhn</a>, <a href=\"http://profiles.wordpress.org/users/ericmann\">Eric Mann</a>, <a href=\"http://profiles.wordpress.org/users/fabifott\">fabifott</a>, <a href=\"http://profiles.wordpress.org/users/peaceablewhale\">Franklin Tse</a>, <a href=\"http://profiles.wordpress.org/users/frumph\">Frumph</a>, <a href=\"http://profiles.wordpress.org/users/garyc40\">garyc40</a>, <a href=\"http://profiles.wordpress.o