ordCamp San Francisco</a> (home of the very first WordCamp), is now accepting speaker applications. Past speakers have included core WordPress developers, people building successful businesses on WordPress, popular bloggers, people from related projects and businesses&#8230;you name it. In addition to Matt Mullenweg&#8217;s annual &#8220;State of the Word&#8221; address, WCSF has played host to talks by people like Mark Jaquith, Matt Cutts, Richard Stallman, Scott Berkun, Karl Fogel, Tim Ferriss, Tara Hunt, Chris Pirillo, and John Lilly. With 3 days of content this year instead of just one, the list of speakers should be even more impressive. If you think you&#8217;d make a good addition to this year&#8217;s roster, check out the <a href=\"http://2011.sf.wordcamp.org/call-for-speakers/\">WCSF Call for Speakers</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"http://wordpress.org/news/2011/05/wordcamp-san-francisco-call-for-speakers/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:47:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n			\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"WordPress 3.1.3 (and WordPress 3.2 Beta 2)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"http://wordpress.org/news/2011/05/wordpress-3-1-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://wordpress.org/news/2011/05/wordpress-3-1-3/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 25 May 2011 18:43:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:8:\"Security\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=1838\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:408:\"WordPress 3.1.3 is available now and is a security update for all previous versions. It contains the following security fixes and enhancements: Various security hardening by Alexander Concha. Taxonomy query hardening by John Lamansky. Prevent sniffing out user names of non-authors by using canonical redirects. Props Verónica Valeros. Media security fixes by Richard Lundeen of Microsoft, Jesse Ou [...]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mark Jaquith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3497:\"<p><a href=\"http://wordpress.org/download/\">WordPress 3.1.3</a> is available now and is a security update for all previous versions. It contains the following security fixes and enhancements:</p>\n<ul>\n<li>Various security hardening by <a href=\"http://www.buayacorp.com\">Alexander Concha</a>.</li>\n<li>Taxonomy query hardening by <a href=\"http://johnlamansky.com/wordpress\">John Lamansky</a>.</li>\n<li>Prevent sniffing out user names of non-authors by using canonical redirects. Props <a href=\"http://www.talsoft.com.ar\">Verónica Valeros</a>.</li>\n<li>Media security fixes by Richard Lundeen of <a href=\"http://www.microsoft.com/\">Microsoft</a>, Jesse Ou of <a href=\"http://www.microsoft.com/\">Microsoft</a>, and <a href=\"http://www.microsoft.com/security/msrc/default.aspx\">Microsoft Vulnerability Research</a>.</li>\n<li>Improves file upload security on hosts with dangerous security settings.</li>\n<li>Cleans up old WordPress import files if the import does not finish.</li>\n<li>Introduce &#8220;clickjacking&#8221; protection in modern browsers on admin and login pages.</li>\n</ul>\n<p>Consult the <a href=\"http://core.trac.wordpress.org/log/branches/3.1/?action=stop_on_copy&amp;mode=stop_on_copy&amp;rev=18023&amp;stop_rev=17805&amp;limit=100\">change log</a> for more details.</p>\n<p><a href=\"http://wordpress.org/download/\">Download WordPress 3.1.3</a> or update automatically from the Dashboard → Updates menu in your site’s admin area.</p>\n<hr />\n<h3>WordPress 3.2 Beta 2 also available</h3>\n<p>In other news, our development of WordPress 3.2 development continues right on schedule. We released <a href=\"http://wordpress.org/news/2011/05/wordpress-3-2-beta-1/\">Beta 1</a> thirteen days ago, and today we&#8217;re putting out Beta 2 for your testing pleasure.</p>\n<p>This is still beta software, so <strong>we don&#8217;t recommend that you use it on production sites</strong>. But if you&#8217;re a plugin developer, a theme developer, or a site administrator, <strong>you should be running this on your test environments</strong> and <a href=\"http://codex.wordpress.org/Reporting_Bugs\">reporting any bugs</a> you find. If you&#8217;re a WordPress user who wants to open your presents early, take advantage of WordPress&#8217; famous 5-minute install and spin up a secondary test site. Let us know what you think!</p>\n<p>The plan is to start putting out release candidates in early June, and to release WordPress 3.2 by the end of the month. The more you help us iron out issues during the beta period, the more likely we are to hit those dates. To misappropriate and mangle a quote from Mahatma Gandhi: &#8220;Be the punctuality you want to see in the WordPress.&#8221; In other words, test now!</p>\n<p>Here are some of the things that changed since Beta 1:</p>\n<ul>\n<li><a href=\"http://code.google.com/chrome/chromeframe/\">Google Chrome Frame</a> is now supported in the admin, if you have it installed. This is especially useful for IE 6 users (remember, IE 6 is otherwise deprecated for the admin).</li>\n<li>The admin is less ugly in IE 7.</li>\n<li>The blue admin color scheme has caught up to the grey one, and is ready for testing.</li>\n<li>We are now bundling jQuery 1.6.1. You should test any JS that uses jQuery. WordPress JavaScript guru Andrew Ozz has <a href=\"http://wpdevel.wordpress.com/2011/05/25/jquery-updates-in-wordpress-3-2/\">a post with more info</a>.</li>\n</ul>\n<p><a href=\"http://wordpress.org/wordpress-3.2-beta2.zip\">Download WordPress 3.2 Beta 2</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://wordpress.org/news/2011/05/wordpress-3-1-3/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s