INSERT INTO `wp_posts` VALUES ('1', '1', '2010-07-08 12:47:43', '2010-07-08 12:47:43', 'Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!', 'Hello world!', 'Curabitur quis metus elit, et lacinia nunc. Fusce adipiscing lorem nec tortor bibendum facilisis. Duis orci lectus, tristique non vestibulum id, rhoncus id ipsum. Donec ullamcorper lacinia est, ac congue magna mattis in. Duis odio lacus, venenatis et volutpat sit amet, molestie vel tortor. Aenean sit amet libero risus. Etiam sed felis ac nisl hendrerit convallis. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Donec rhoncus', 'trash', 'open', 'open', '', 'hello-world', '', '', '2010-10-20 08:22:32', '2010-10-20 08:22:32', '', '0', 'http://www.webtrendz.co.uk/queensparkrealestates/?p=1', '0', 'post', '', '1');
INSERT INTO `wp_posts` VALUES ('2', '1', '2010-07-08 12:47:43', '2010-07-08 12:47:43', '<h2>About Queens Park Real Estates</h2>\r\nFounded in 1991 Queens Park Real Estates has become specialist local Knowledge in Kilburn, West Hampstead, Brondesbury, Queens Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden, Kensal Rise, Kensal Green, Kingsbury and Part of Middlesex area of Wembley and Kenton.\r\n\r\nNow in our seventeenth year of business QPRE is a key player in residential, Sales and lettings due to our strict policy of putting our clients (seller, vendors, buyer and tenants) at the heart of our business and delivering a tailored made service. This is why so many people continue to come through our doors. As they know that they are going to obtain an honest service.\r\n\r\nQueens Park Real Estates is an Independent Agency and a member of the Ombudsman Scheme which adheres to the strict codes of practice.', 'About us', '', 'trash', 'closed', 'closed', '', 'about-us', '', '', '2010-12-21 11:26:02', '2010-12-21 11:26:02', '', '0', 'http://www.webtrendz.co.uk/queensparkrealestates/?page_id=2', '2', 'page', '', '0');
INSERT INTO `wp_posts` VALUES ('4', '1', '2010-07-09 08:04:02', '2010-07-09 08:04:02', '<h2>Queens Park Landlord Services</h2>\r\nOur Services listed below are designed to satisfy your needs and if we have not covered some of your requirements we are here to discuss and incorporate them. \r\n[singlepic id=6 float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\"><strong>Letting only:</strong>\r\n<ul>\r\n\r\n•	We market your property via our different marketing portals\r\n•	We arrange viewing according to your instructions.\r\n•	We inform you of all offers received and allow you to make your choice of a suitable tenant\r\n•	Taking and holding of the deposit paid\r\n•	We apply for the potential tenants (employer, bank, current or previous landlords) references\r\n•	We agree with both parties (landlord and tenant) on a move in date and draw up a tenancy agreement. This can be tailored to suit individual circumstances to reflect all terms agreed \r\n•	Conduct the check- in (inventory) on the move in date\r\n•	Transfer utility accounts to the names of the new tenants\r\n•	We prepare a statement of account and pass on all due rents to the landlord  as soon as administratively possible \r\n•	Accounting to the Inland Revenue for tax purposes where applicable.\r\n•	Serving of notices to tenants where necessary at an extra cost.\r\n•	We also check tenants out of the property at the end of tenancy.\r\n</ul>\r\n\r\n\r\n<strong>Letting and management</strong>\r\n<p class=\"subheadings\">Under the letting and management services we carry out all the services under the letting only above and in addition to the other services listed below;</p>\r\n\r\n<ul>\r\n•	Some landlords live abroad or just too busy to deal with the day to day repairs and maintenance of their property. As managing agents we do all this for you.\r\n•	Rent guarantee insurance\r\n•	We arrange for the renewal of the annual gas and electric checks \r\n•	We do carry out a periodic visit to the property\r\n•	Comparing the schedule of check in against the check out and providing an estimate for the cost of damage.\r\n•	Negotiating between parties over dispute arising as a result of damages\r\n•	Serving a notice at the end of tenancy\r\n•	Representing the landlord in court if required\r\n•	Overseeing refurbishment work carried out in the property</ul>\r\n\r\n\r\n<strong>Management only</strong>\r\n<p class=\"subheadings\">For landlords who have secured the tenants themselves and all they need is an agent to manage the property in their absence. We are able to provide all the services listed below;</p>\r\n<ul>\r\n•	As managing agents we deal with the maintenance and day to day repairs of your property.\r\n•	We arrange for the renewal of the annual gas and electric checks \r\n•	We do carry out a periodic visit to the property\r\n•	Arrange for renewal of the existing tenancy agreement \r\n•	Serving a notice at the end of tenancy\r\n•	Representing the landlord in court if need be\r\n•	Overseeing refurbishment work carried out in the property\r\n\r\n</ul>\r\n</div>', 'Landlords', '', 'publish', 'closed', 'closed', '', 'landlords', '', '', '2011-06-06 12:29:05', '2011-06-06 12:29:05', '', '0', 'http://www.webtrendz.co.uk/queensparkrealestates/?page_id=4', '3', 'page', '', '0');
