INSERT INTO `wp_posts` VALUES ('275', '1', '2010-12-21 11:10:24', '2010-12-21 11:10:24', '<h1>Welcome to Queens Park Real Estates</h1>\r\nQueens Park Real Estates an independent letting ,sale and managing  agents of  residential properties in Kilburn, West Hampstead, Brondesbury,  Queens Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden,  Kensal Rise, Kensal Green, Kingsbury and Part of Middlesex area and around London\r\nFounded in 1991 Queens Park Real Estates has a comprehensive knowledge of our local area and based on our continuous loyalty and undivided attention our agent gives to our clients (seller, vendors, buyer and tenants) we have continuous flock of people coming through our door.\r\nWe provide a full management service if required and maintain competitive commission rates on a no sale-no fees basis.\r\nOur agents are trained to uphold high values, rendering excellent service to all our clients. We are a member of the Ombudsman Scheme which adheres to the strict codes of practice.\r\nWhy not speak to one of or agent now for more details on 0207 372 5950 or email us on info@queensparkrealestates.co.uk\r\n', 'Home', '', 'inherit', 'open', 'open', '', '32-revision-11', '', '', '2010-12-21 11:10:24', '2010-12-21 11:10:24', '', '32', 'http://www.queensparkrealestates.co.uk/2010/12/21/32-revision-11/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('269', '1', '2010-12-21 11:24:38', '2010-12-21 11:24:38', '<h2>About Queens Park Real Estates</h2>\nFounded in 1991 Queens Park Real Estates has become specialist local Knowledge in Kilburn, West Hampstead, Brondesbury, Queens Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden, Kensal Rise, Kensal Green, Kingsbury and Part of Middlesex area of Wembley and Kenton.\n\nNow in our seventeenth year of business QPRE is a key player in residential, Sales and lettings due to our strict policy of putting our clients (seller, vendors, buyer and tenants) at the heart of our business and delivering a tailored made service. This is why so many people continue to come through our doors. As they know that they are going to obtain an honest service.\n\nQueens Park Real Estates is an Independent Agency and a member of the Ombudsman Scheme which adheres to the strict codes of practice.', 'About us', '', 'inherit', 'open', 'open', '', '2-autosave', '', '', '2010-12-21 11:24:38', '2010-12-21 11:24:38', '', '2', 'http://www.queensparkrealestates.co.uk/2010/12/21/2-autosave/', '0', 'revision', '', '0');
