INSERT INTO `wp_posts` VALUES ('55', '1', '2010-07-14 11:18:52', '2010-07-14 11:18:52', '<div id=\"landlordServices\" class=\"WebsiteContent\">\r\n\r\n[singlepic id=7  float=]\r\n\r\nAt Queens Park we believe that it is essential to communicate effectively and will always offer honest impartial advice to our tenants throughout the tenancy.\r\n\r\nWe are able to offer a professional service to individuals, companies and relocation agencies.\r\n\r\nIf you are interested in renting through Queens Park please call on 0207 372 5950 or e-mail : info@Queens Park.co.uk\r\n<p class=\"subheadings\">Requirements</p>\r\n\r\n\r\nBefore you rent a property through Queens Park, we will take up references on behalf of the landlord which will normally include an employer’s reference, any former landlord and an additional credit reference. Where a tenant is unable to meet the required income or credit checks, you will be asked to provide a Guarantor to underwrite any rent liabilities.\r\n\r\nYou will be required to pay a deposit against damages together with 4 week\'s rent in advance. Many tenants are concerned about their security deposit. By renting through us, your deposit will be protected by the Tenancy Deposit Scheme (TDS) operated by an independent body which ensures that only legitimate claims are made against deposits. The TDS also offers a dispute resolution service for cases where parties are unable to reach an agreement.\r\n<p class=\"subheadings\">Documentation</p>\r\n\r\n\r\nOur tenancy agreements have been carefully drafted using plain English and will clearly state what type of tenancy you have and which party carries which responsibility. It is important that you read your tenancy agreement thoroughly. If you are unsure of anything, one of our team will be happy to assist you.\r\n\r\nAll documentation will be carefully explained to ensure you fully understand the legal implications before signing the tenancy agreement and committing to the tenancy.\r\n\r\nIt is important that you attend the inventory check-in so that can agree to any amendments. We recommend you keep the check-in and your tenancy agreement in a safe place as these form the basis for any claims for damages at the end of the tenancy.\r\n<p class=\"subheadings\">Looking after the property</p>\r\n\r\n\r\nYour landlord is liable for most maintenance and repairs to the property but it is your duty to notify us of any problems you notice. Routine housework such as cleaning, gardening, renewal of light bulbs will be your responsibility.\r\n\r\n</div>', 'Tenants', '', 'inherit', 'open', 'open', '', '8-revision-3', '', '', '2010-07-14 11:18:52', '2010-07-14 11:18:52', '', '8', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/07/14/8-revision-3/', '0', 'revision', '', '0');
