INSERT INTO `wp_posts` VALUES ('108', '1', '2010-08-08 00:23:24', '2010-08-08 00:23:24', '<h2>Welcome to Queens Park</h2>\r\nQueens Park Real Estates an independent letting and sale agents of  residential flats and houses in Kilburn, West Hampstead, Brondesbury,  QueensPark, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden,  Kensal Rise, Kensal Green, Kingsbury and Part of Middlesex area of  Wembley and Kenton.\r\n\r\nWe provide a full management service if required and maintain  competitive commission rates on a no sale-no fees basis\r\n\r\nFor more information on our services call us on 0207 372 5950  or email us on info@Queens Park.co.uk', 'Home', '', 'inherit', 'open', 'open', '', '32-revision-6', '', '', '2010-08-08 00:23:24', '2010-08-08 00:23:24', '', '32', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/08/08/32-revision-6/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('109', '1', '2010-07-14 11:17:26', '2010-07-14 11:17:26', '<h2>Queens Park Landlord Services</h2>\r\n[singlepic id=6 float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\"><strong>We can tailor our services to your particular requirements, however:</strong>\r\n<ul>\r\n	<li>We Guarantee you don\'t pay us a penny and your not tied in unless we find you a tenant your happy with (no upfront fees at all)</li>\r\n	<li>Rent guarantee on your property for 6 or 12 months is available</li>\r\n	<li>We aim to keep our fees one of the lowest of any quality agent in the area</li>\r\n	<li>We only focus on Lettings and Management</li>\r\n	<li>We have a policy to always be upfront and honest</li>\r\n	<li>We take advantage of all the latest technology and tools to let your property quickly</li>\r\n	<li>The longest opening hours: In response to the demands of living and working we have found that many people cannot make viewings within most of our competitors working hours. We strive to make viewings and valuations at a time that is convenient to you up to 8.30pm, 7 days a week.</li>\r\n	<li>Quality 3rd party referencing to insure you get impartial checks to insure the highest caliber of tenants for your property.</li>\r\n</ul>\r\n<strong>Let Only Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels.</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out referencing on the tenant including credit checking.</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance with. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds</li>\r\n	<li>To organise a schedule of condition. (Full inventory available)</li>\r\n	<li>To forward all monies to the landlord via either bank transfer or cheque minus our agreed fee.</li>\r\n</ul>\r\n<strong>Full Management Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out reference on the tenant including credit checking</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds. To provide an inventory of the property and check the tenant in including taking meter readings</li>\r\n	<li>To organise a full Inventory, and do a property handover with the tenant</li>\r\n	<li>To respond to all disrepair reported to us from the tenant during the duration of the tenancy. To inform the landlord of any such reports, and obtain quotes so that action may be taken.</li>\r\n	<li>To comply with all reasonable instructions received from the landlord in relation to the management of the property in accordance to the principles of good management.</li>\r\n	<li>To carry out a check out once the tenant has vacated the property and advise the landlord of any discrepancies with the schedule of condition / inventory and state of the property.</li>\r\n	<li>To forward the rent to the landlord minus our agreed fee on a monthly basis. The landlord can choose to receive this either by bank transfer or cheque.</li>\r\n</ul>\r\n</div>', 'Landlords', '', 'inherit', 'open', 'open', '', '4-revision-9', '', '', '2010-07-14 11:17:26', '2010-07-14 11:17:26', '', '4', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/07/14/4-revision-9/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('110', '1', '2010-07-14 11:19:21', '2010-07-14 11:19:21', '<h2>Tenants Information</h2>\r\n[singlepic id=7  float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\">At Queens Park we believe that it is essential to communicate effectively and will always offer honest impartial advice to our tenants throughout the tenancy.\r\n\r\nWe are able to offer a professional service to individuals, companies and relocation agencies.\r\n\r\nIf you are interested in renting through Queens Park please call on 0207 372 5950 or e-mail : info@Queens Park.co.uk\r\n<p class=\"subheadings\">Requirements</p>\r\nBefore you rent a property through Queens Park, we will take up references on behalf of the landlord which will normally include an employer’s reference, any former landlord and an additional credit reference. Where a tenant is unable to meet the required income or credit checks, you will be asked to provide a Guarantor to underwrite any rent liabilities.\r\n\r\nYou will be required to pay a deposit against damages together with 4 week\'s rent in advance. Many tenants are concerned about their security deposit. By renting through us, your deposit will be protected by the Tenancy Deposit Scheme (TDS) operated by an independent body which ensures that only legitimate claims are made against deposits. The TDS also offers a dispute resolution service for cases where parties are unable to reach an agreement.\r\n<p class=\"subheadings\">Documentation</p>\r\nOur tenancy agreements have been carefully drafted using plain English and will clearly state what type of tenancy you have and which party carries which responsibility. It is important that you read your tenancy agreement thoroughly. If you are unsure of anything, one of our team will be happy to assist you.\r\n\r\nAll documentation will be carefully explained to ensure you fully understand the legal implications before signing the tenancy agreement and committing to the tenancy.\r\n\r\nIt is important that you attend the inventory check-in so that can agree to any amendments. We recommend you keep the check-in and your tenancy agreement in a safe place as these form the basis for any claims for damages at the end of the tenancy.\r\n<p class=\"subheadings\">Looking after the property</p>\r\nYour landlord is liable for most maintenance and repairs to the property but it is your duty to notify us of any problems you notice. Routine housework such as cleaning, gardening, renewal of light bulbs will be your responsibility.\r\n\r\n</div>', 'Tenants', '', 'inherit', 'open', 'open', '', '8-revision-4', '', '', '2010-07-14 11:19:21', '2010-07-14 11:19:21', '', '8', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/07/14/8-revision-4/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('111', '1', '2010-07-14 11:21:47', '2010-07-14 11:21:47', '<h2>Information for Vendors</h2>\r\n[singlepic id=8 float=]\r\n<div id=\"VendoInformation\" class=\"WebsiteContent\">\r\nIt is an unfortunate fact that one in four sales in the UK fail to complete. But we continue to take action to reduce that figure. Whilst many agents don\'t have this facility, we have a team of dedicated Move Managers covering our branch network. Their commitment is to move the sale on to a quick conclusion. Experienced in both the legal process and customer service, these office-based managers offer one of the facets of our service which is most highly regarded by our clients.\r\n\r\nStatistics show the innovation has managed to reduce the time a sale takes to progress from \'under offer\' to a successful exchange of contracts, a tremendous benefit to our clients. \r\n<br><br>\r\n<p class=\"subheadings\">Useful and time saving pointers</p><br>\r\n\r\n<ul>\r\n\r\n<li>Instruct your solicitor early on so they can begin some of the procedures and prepare some of the documentation - it saves valuable time once a buyer has been found for your home. Not got a solicitor? We can appoint one to act for you.</li>\r\n<li>Advise your solicitor of your mortgage account number and name of your mortgage lender so they can obtain the deeds in advance; this can save, literally, weeks at a later stage.</li>\r\n<li>Complete the fixtures and fittings enquiry form provided and return it to your solicitor.</li>\r\n<li>If the property is jointly owned, both parties need to agree to it being sold and that the price is acceptable. Your solicitor will need to know the details of any agreements that you have.</li>\r\n<li>If the property you are selling is a flat or leasehold you will need to ensure that your ground rent and management service charges are up to date.</li>\r\n\r\n</ul>\r\nCall 0207 372 5950 for a free valuation or email sales@Queens Park.co.uk<br><br>\r\n\r\n\r\n<p class=\"subheadings\">Valuation - Getting the price right</p><br>\r\n\r\nIn a stable or declining market, an overpriced property simply will not sell; there are too many other homes with similar benefits which are more competitively priced.\r\n\r\nWouldn\'t it be wonderful if home-owners could set the price for their own homes? They would simply add up the original cost, plus any improvements and add an appropriate profit. \r\n\r\nMaybe the estate agent could determine the price in consultation with the owner? However, the fact is that neither the owner\'s investment, nor their economic conditions and desires, nor the estate agent\'s opinion has anything to do with the market value of a home. Ultimately it is the buyer who sets the price; as until a buyer commits to purchase at a specific price, the value of a home remains undetermined.\r\n\r\nWhilst it is the buyer who determines the selling price, it is the owner, in consultation with the estate agent, who sets the asking price.\r\n<br> <br>\r\n\r\n\r\n<p class=\"subheadings\">Marketing Your Home With Technology</p><br>\r\n\r\n\r\nSelling your home via the internet\r\nE-mail updates the minute a property goes live.\r\n<br>\r\n\r\n<b>Over 80% of buyers are updated via e-mail about latest listed homes as they become available. So, when we sell your property, details reach our database of applicants in record time, often within 3hrs hours of the property coming onto the market.</b>\r\n<br><br>\r\n<p class=\"subheadings\">Virtual Tours and floorplans</p><br>\r\nVirtual Tours and floorplans of most properties are available to view on the Queens Park website. These save time and inconvenience for you and your potential buyers. Our research shows that homes with Virtual Tours produce high quality viewings, which can result in significantly less people needing to be shown your home before a sale is achieved. Our office be able to provide full details for you including a live demonstration. Better people providing the best service Our biggest asset is our staff. Queens Park attracts and selects the best in the business and employs more staff to be at your service. This ensures that we respond to your needs as quickly and efficiently as possible. Our teams are highly trained professionals whose local knowledge and expertise ensure the service you receive is of the highest standard. \r\n\r\n\r\n\r\n\r\n\r\n</div>', 'Vendors', '', 'inherit', 'open', 'open', '', '11-revision-3', '', '', '2010-07-14 11:21:47', '2010-07-14 11:21:47', '', '11', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/07/14/11-revision-3/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('112', '1', '2010-08-08 00:28:06', '2010-08-08 00:28:06', '<h2>About Queens Park Real Estates</h2>\r\nFounded in 1991 Queens Park Real Estates has become  	specialist local Knowledge in Kilburn, West Hampstead, Brondesbury,  Queens  	Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden,  Kensal  	Rise, Kensal Green, Kingsbury and Part of Middlesex area of Wembley and   	Kenton.\r\n\r\nNow in our seventeenth year of business QPRE is a key player in  residential,  	Sales and lettings due to our strict policy of putting our clients  (seller,  	vendors, buyer and tenants) at the heart of our business and delivering  a  	tailored made service. This is why so many people continue to come  through  	our doors. As they know that they are going to obtain an honest  service.\r\n\r\nQueens Park Real Estates is an Independent Agency and a member of the  	Ombudsman Scheme which adheres to the strict codes of practice.', 'About us', '', 'inherit', 'open', 'open', '', '2-revision-6', '', '', '2010-08-08 00:28:06', '2010-08-08 00:28:06', '', '2', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/08/08/2-revision-6/', '0', 'revision', '', '0');
