INSERT INTO `wp_posts` VALUES ('114', '1', '2011-08-26 15:04:36', '2011-08-26 15:04:36', '<h1>Welcome to Queens Park Real Estates</h1>\r\nQueens Park Real Estates, independent Estate Agents, based in London , United Kingdom. \r\nWe specialize in property Sales, Lettings and Management in the U.K. and International.\r\nFounded in 1991 Queens Park Real Estates has a comprehensive knowledge of the local area and based on our continuous loyalty and undivided attention our agents give to customers (sellers, landlords, purchasers and tenants) they keep coming back and recommending us to others.\r\n\r\nWe provide a full management service if required and maintain competitive commission rates on a no sale-no fees basis.\r\nOur agents are trained to uphold high values of the industry, rendering excellent service to all our clients. We are also a member of the Ombudsman Scheme which adheres to the strict codes of practice.\r\nWhy not speak to one of our agents now for more details on 0207 372 5950 or email us on info@queensparkrealestates.co.uk', 'Home', '', 'inherit', 'open', 'open', '', '32-autosave', '', '', '2011-08-26 15:04:36', '2011-08-26 15:04:36', '', '32', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/08/08/32-autosave/', '0', 'revision', '', '0');
