INSERT INTO `wp_posts` VALUES ('159', '1', '2011-01-18 23:43:54', '2011-01-18 23:43:54', '<p>Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.</p>\n\n<p>Our aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.</p>\n\n<p>At Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.</p>\n\n<div class=\"highlight\">\n	<h2>Why should I advertise my property with Queens Park Real Estates?\n</h2>\n<ul class=\"ticks\">\n    <li>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</li>\n    <li>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 days a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at your convenience.</li>\n    <li>Advertisement is very quick and easy to do; your property becomes live within 24hrs of completing the transaction.\n        One off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</li>\n    <li>We are a one stop shop for all your property needs.</li>\n    <li>Your property could be advertised up to 12 months (sales) and 4 months (letting). This gives you enough time to find a suitable buyer /tenant for your property.</li>\n    <li>We have a team that understands your local language and what you need.</li>\n</ul>\n<p><a href=\"http://www.queensparkrealestates.co.uk/international/i-want-to-let-my-property/\" class=\"letsSignUP\">I want to LET my property</a><a href=\"http://www.queensparkrealestates.co.uk/international/i-want-to-sell/\" class=\"salesSignUP\">I want to SELL my property</a></p>\n\n</div>', 'International', '', 'inherit', 'open', 'open', '', '155-autosave', '', '', '2011-01-18 23:43:54', '2011-01-18 23:43:54', '', '155', 'http://www.webtrendz.co.uk/queensparkrealestates/2010/09/10/155-autosave/', '0', 'revision', '', '0');
