INSERT INTO `wp_posts` VALUES ('267', '1', '2010-12-21 10:24:18', '2010-12-21 10:24:18', '<h1>Welcome to Queens Park Real Estates</h1>\r\nQueens Park Real Estates an independent letting and sale agents of  residential flats and houses in Kilburn, West Hampstead, Brondesbury,  QueensPark, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden,  Kensal Rise, Kensal Green, Kingsbury and Part of Middlesex area of  Wembley and Kenton.\r\n\r\nWe provide a full management service if required and maintain  competitive commission rates on a no sale-no fees basis\r\nFounded in 1991 Queens Park Real Estates has become  	specialist local Knowledge in Kilburn, West Hampstead, Brondesbury,  Queens  	Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden,  Kensal  	Rise, Kensal Green, Kingsbury and Part of Middlesex area of Wembley and   	Kenton.\r\n\r\nNow in our seventeenth year of business QPRE is a key player in  residential,  	Sales and lettings due to our strict policy of putting our clients  (seller,  	vendors, buyer and tenants) at the heart of our business and delivering  a  	tailored made service. This is why so many people continue to come  through  	our doors. As they know that they are going to obtain an honest  service.\r\n\r\nQueens Park Real Estates is an Independent Agency and a member of the  	Ombudsman Scheme which adheres to the strict codes of practice.\r\n\r\nFor more information on our services call us on 0207 372 5950  or email us on info@queensparkrealestates.co.uk', 'Home', '', 'inherit', 'open', 'open', '', '32-revision-10', '', '', '2010-12-21 10:24:18', '2010-12-21 10:24:18', '', '32', 'http://www.queensparkrealestates.co.uk/2010/12/21/32-revision-10/', '0', 'revision', '', '0');
