INSERT INTO `wp_posts` VALUES ('187', '1', '2010-09-22 12:04:51', '2010-09-22 12:04:51', 'According to More Than Business, ten per cent of British homeowners may have to downsize and would have to rent their dwellings out in the event of a double-dip recession.\r\n\r\nA further 34 per cent admitted they will be forced to consider the option, while 14 per cent of those in London claimed they would have no choice but to let their domiciles.\r\n\r\nMike Bowman, head of More Than Business, urged people to carefully think about their actions, as 75 per cent do not have enough legal knowledge on the responsibilities that come with being a landlord.\r\n\r\n\"There are numerous potential pitfalls when it comes to letting a property - it\'s not as simple as finding a tenant and sitting back waiting for the rent to come,\" he added.\r\n\r\nEarlier this week, a report by the Buildings Societies Association revealed confidence in the housing market is still low.\r\n\r\nThe number of consumers who do not think now is a good time to buy an abode has increased from 21 per cent in June to 26 per cent in September.', 'Double-dip recession \'could lead to a rise in unreluctant landlords\'', '', 'publish', 'open', 'open', '', 'double-dip-recession-could-lead-to-a-rise-in-unreluctant-landlords', '', '', '2010-09-22 12:04:51', '2010-09-22 12:04:51', '', '0', 'http://webtrendz.co.uk/queensparkrealestates/?p=187', '0', 'post', '', '0');
