INSERT INTO `wp_posts` VALUES ('188', '1', '2010-09-22 12:03:38', '2010-09-22 12:03:38', 'According to More Than Business, ten per cent of British homeowners may have to downsize and would have to rent their dwellings out in the event of a double-dip recession.\n\nA further 34 per cent admitted they will be forced to consider the option, while 14 per cent of those in London claimed they would have no choice but to let their domiciles.\n\nMike Bowman, head of More Than Business, urged people to carefully think about their actions, as 75 per cent do not have enough legal knowledge on the responsibilities that come with being a landlord.\n\n\"There are numerous potential pitfalls when it comes to letting a property - it\'s not as simple as finding a tenant and sitting back waiting for the rent to come,\" he added.\n\nEarlier this week, a report by the Buildings Societies Association revealed confidence in the housing market is still low.\n\nThe number of consumers who do not think now is a good time to buy an abode has increased from 21 per cent in June to 26 per cent in September.', 'Double-dip recession \'could lead to a rise in unreluctant landlords\'', '', 'inherit', 'open', 'open', '', '187-revision', '', '', '2010-09-22 12:03:38', '2010-09-22 12:03:38', '', '187', 'http://webtrendz.co.uk/queensparkrealestates/2010/09/22/187-revision/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('189', '1', '2010-09-22 12:05:55', '2010-09-22 12:05:55', 'According to More Than Business, ten per cent of British homeowners may have to downsize and would have to rent their dwellings out in the event of a double-dip recession.\n\nA further 34 per cent admitted they will be forced to consider the option, while 14 per cent of those in London claimed they would have no choice but to let their domiciles.\n\nMike Bowman, head of More Than Business, urged people to carefully think about their actions, as 75 per cent do not have enough legal knowledge on the responsibilities that come with being a landlord.\n\n\"There are numerous potential pitfalls when it comes to letting a property - it\'s not as simple as finding a tenant and sitting back waiting for the rent to come,\" he added.\n\nEarlier this week, a report by the Buildings Societies Association revealed confidence in the housing market is still low.\n\nThe number of consumers who do not think now is a good time to buy an abode has increased from 21 per cent in June to 26 per cent in September.', 'Double-dip recession \'could lead to a rise in unreluctant landlords\'', '', 'inherit', 'open', 'open', '', '187-autosave', '', '', '2010-09-22 12:05:55', '2010-09-22 12:05:55', '', '187', 'http://webtrendz.co.uk/queensparkrealestates/2010/09/22/187-autosave/', '0', 'revision', '', '0');
