INSERT INTO `wp_posts` VALUES ('225', '1', '2010-08-08 00:30:43', '2010-08-08 00:30:43', '<h2>About Queens Park Real Estates</h2>\r\nFounded in 1991 Queens Park Real Estates has become  	specialist local Knowledge in Kilburn, West Hampstead, Brondesbury,  Queens  	Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden,  Kensal  	Rise, Kensal Green, Kingsbury and Part of Middlesex area of Wembley and   	Kenton.\r\n\r\nNow in our seventeenth year of business QPRE is a key player in  residential,  	Sales and lettings due to our strict policy of putting our clients  (seller,  	vendors, buyer and tenants) at the heart of our business and delivering  a  	tailored made service. This is why so many people continue to come  through  	our doors. As they know that they are going to obtain an honest  service.\r\n\r\nQueens Park Real Estates is an Independent Agency and a member of the  	Ombudsman Scheme which adheres to the strict codes of practice.', 'About us', '', 'inherit', 'open', 'open', '', '2-revision-7', '', '', '2010-08-08 00:30:43', '2010-08-08 00:30:43', '', '2', 'http://www.queensparkrealestates.co.uk/2010/08/08/2-revision-7/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('226', '1', '2010-08-08 00:28:47', '2010-08-08 00:28:47', '<h2>Queens Park Landlord Services</h2>\r\n[singlepic id=6 float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\"><strong>We can tailor our services to your particular requirements, however:</strong>\r\n<ul>\r\n	<li>We Guarantee you don\'t pay us a penny and your not tied in unless we find you a tenant your happy with (no upfront fees at all)</li>\r\n	<li>Rent guarantee on your property for 6 or 12 months is available</li>\r\n	<li>We aim to keep our fees one of the lowest of any quality agent in the area</li>\r\n	<li>We only focus on Lettings and Management</li>\r\n	<li>We have a policy to always be upfront and honest</li>\r\n	<li>We take advantage of all the latest technology and tools to let your property quickly</li>\r\n	<li>The longest opening hours: In response to the demands of living and working we have found that many people cannot make viewings within most of our competitors working hours. We strive to make viewings and valuations at a time that is convenient to you up to 8.30pm, 7 days a week.</li>\r\n	<li>Quality 3rd party referencing to insure you get impartial checks to insure the highest caliber of tenants for your property.</li>\r\n</ul>\r\n<strong>Let Only Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels.</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out referencing on the tenant including credit checking.</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance with. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds</li>\r\n	<li>To organise a schedule of condition. (Full inventory available)</li>\r\n	<li>To forward all monies to the landlord via either bank transfer or cheque minus our agreed fee.</li>\r\n</ul>\r\n<strong>Full Management Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out reference on the tenant including credit checking</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds. To provide an inventory of the property and check the tenant in including taking meter readings</li>\r\n	<li>To organise a full Inventory, and do a property handover with the tenant</li>\r\n	<li>To respond to all disrepair reported to us from the tenant during the duration of the tenancy. To inform the landlord of any such reports, and obtain quotes so that action may be taken.</li>\r\n	<li>To comply with all reasonable instructions received from the landlord in relation to the management of the property in accordance to the principles of good management.</li>\r\n	<li>To carry out a check out once the tenant has vacated the property and advise the landlord of any discrepancies with the schedule of condition / inventory and state of the property.</li>\r\n	<li>To forward the rent to the landlord minus our agreed fee on a monthly basis. The landlord can choose to receive this either by bank transfer or cheque.</li>\r\n</ul>\r\n</div>', 'Landlords', '', 'inherit', 'open', 'open', '', '4-revision-10', '', '', '2010-08-08 00:28:47', '2010-08-08 00:28:47', '', '4', 'http://www.queensparkrealestates.co.uk/2010/08/08/4-revision-10/', '0', 'revision', '', '0');
