INSERT INTO `wp_posts` VALUES ('391', '1', '2011-05-31 14:31:46', '2011-05-31 14:31:46', '<h1>Welcome to Queens Park Real Estates</h1>\r\nQueens Park Real Estates, an independent Estate Agents, based in London , United Kingdom. \r\nWe specialize in property Sales, Lettings and Management in the U.K. and Internatinal.\r\nFounded in 1991 Queens Park Real Estates has a comprehensive knowledge of the local area and based on our continuous loyalty and undivided attention our agents give to clients (seller, vendors, buyer and tenants) they keep coming back and recommending us to others\r\n\r\nWe provide a full management service if required and maintain competitive commission rates on a no sale-no fees basis.\r\nOur agents are trained to uphold high values of the industry, rendering excellent service to all our clients. We are also a member of the Ombudsman Scheme which adheres to the strict codes of practice.\r\nWhy not speak to one of our agents now for more details on 0207 372 5950 or email us on info@queensparkrealestates.co.uk', 'Home', '', 'inherit', 'open', 'open', '', '32-revision-14', '', '', '2011-05-31 14:31:46', '2011-05-31 14:31:46', '', '32', 'http://www.queensparkrealestates.co.uk/2011/05/31/32-revision-14/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('281', '1', '2010-12-23 10:00:21', '2010-12-23 10:00:21', 'Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.\r\n\r\nOur aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.\r\n\r\nAt Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.\r\n\r\n<strong><span style=\"font-size: 14pt;\">Why should I advertise my property with Queens Park Real Estates? </span></strong>\r\n<p style=\"margin-bottom: 12pt;\"><strong> </strong></p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;quot;\"><strong> </strong></span></span></span>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;quot;\"> </span></span></span>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 day a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at you convenience.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;quot;\"><strong> </strong></span></span></span>Advertisement is very quick and easy to do; your property becomes live within 24hrs of completing the transaction.\r\nOne off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;quot;\"> </span></span></span>We are a one stop shop or all your property needs.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;quot;\"> </span></span></span>You property could be advertised up to 12 months and this gives you enough time to find a suitable buyer for your home.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;quot;\"> </span></span></span>We have a team that understand your local language and understands exactly what you need.</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt;\"> </p>', 'International', '', 'inherit', 'open', 'open', '', '155-revision-9', '', '', '2010-12-23 10:00:21', '2010-12-23 10:00:21', '', '155', 'http://www.queensparkrealestates.co.uk/2010/12/23/155-revision-9/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('286', '1', '2011-01-05 18:32:18', '2011-01-05 18:32:18', '<h3>our sale packages</h3>\r\nWe at Queens Park Real Estates have devised 3 different packages tailored to suit the marketing and sale requirements of your property and are as follows;\r\n<div class=\"cols3container\">\r\n<div class=\"col blue\">\r\n<div class=\"contentContainer\">\r\n<h2>Band A</h2>\r\n<ul class=\"ticks\">\r\n	<li>12 months online and offline advertisement  via the internet and all other marketing portals</li>\r\n	<li>Currently we advertise on our website and other popular and most visited property marketing sites around the world.</li>\r\n	<li>You are in total control of the advertisement of your property; all you need do is open an account with us, supply details of your property, upload pictures, and any other details you know would best portray the property.</li>\r\n	<li>You decide how you want applicants to contact you and they contact you directly</li>\r\n	<li>You arrange viewings at your convenience and negotiate the best price for your property</li>\r\n	<li>You can have the property on our site for 12months giving you enough time to advertise and complete.</li>\r\n	<li><strong>1 Property = £100 per year</strong></li>\r\n	<li><strong>2 Properties = £150 per year</strong></li>\r\n	<li><strong>more than 2 properties = £150 + £25 per extra property per year\r\n</strong></li>\r\n</ul>\r\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">Order this package</a>\r\n\r\n</div>\r\n</div>\r\n<div class=\"col orange\">\r\n<h2>Band B</h2>\r\n<ul class=\"ticks\">\r\n	<li>All options from <strong>Band A</strong></li>\r\n	<li>Property Valuation is provided</li>\r\n	<li>Professional pictures, floor plans and other document required by law are provided</li>\r\n	<li>Advice you as to simple improvements that can be made to the property to increase Value</li>\r\n	<li>Properties are marketed by our local representative in your region (please confirm with our team if we do have an office or representative in your region).</li>\r\n	<li><strong>1 Property = £250 per year</strong></li>\r\n	<li><strong>2 Properties in the same country = £350 per year</strong></li>\r\n	<li><strong>more than 2 properties in the same country = £350 + £50 per extra property per year\r\n</strong></li>\r\n</ul>\r\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">Order this package</a>\r\n\r\n</div>\r\n<div class=\"col green\">\r\n<h2>Band C</h2>\r\n<ul class=\"ticks\">\r\n	<li>All options from <strong>Band B</strong></li>\r\n	<li>We take charge of the sale of your property from valuation to completion</li>\r\n	<li>We arrange viewings on your behalf according to your instruction</li>\r\n	<li>Negotiate the best possible price for your property</li>\r\n	<li><strong>Cost of £100 and the sales commission applies ( this varies from one country to country, please ask our team what the applied sale commission in your region)</strong></li>\r\n</ul>\r\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">\r\nContact our team\r\n</a>\r\n\r\n</div>\r\n</div>', 'I want to SELL my property', '', 'publish', 'open', 'closed', '', 'i-want-to-sell-my-property', '', '', '2011-01-27 14:29:36', '2011-01-27 14:29:36', '', '155', 'http://www.queensparkrealestates.co.uk/', '0', 'page', '', '0');
