INSERT INTO `wp_posts` VALUES ('297', '1', '2010-12-23 12:44:44', '2010-12-23 12:44:44', 'Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.\r\n\r\nOur aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.\r\n\r\nAt Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.\r\n\r\n<strong><span style=\"font-size: 14pt;\">Why should I advertise my property with Queens Park Real Estates? </span></strong>\r\n<p style=\"margin-bottom: 12pt;\"><strong> </strong></p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;amp;\"><strong> </strong></span></span></span>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;amp;\"> </span></span></span>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 day a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at you convenience.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;amp;\"><strong> </strong></span></span></span>Advertisement is very quick and easy to do; your property becomes live within 24hrs of completing the transaction.\r\nOne off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;amp;\"> </span></span></span>We are a one stop shop or all your property needs.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;amp;\"> </span></span></span>You property could be advertised up to 12 months and this gives you enough time to find a suitable buyer for your home.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;amp;amp;\"> </span></span></span>We have a team that understand your local language and what you need.</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt;\"> </p>', 'International', '', 'inherit', 'open', 'open', '', '155-revision-10', '', '', '2010-12-23 12:44:44', '2010-12-23 12:44:44', '', '155', 'http://www.queensparkrealestates.co.uk/2010/12/23/155-revision-10/', '0', 'revision', '', '0');
