INSERT INTO `wp_posts` VALUES ('312', '1', '2011-01-07 02:02:26', '2011-01-07 02:02:26', '<p>Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.</p>\r\n\r\n<p>Our aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.</p>\r\n\r\n<p>At Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.</p>\r\n\r\n<div class=\"highlight\">\r\n	<h2>Why should I advertise my property with Queens Park Real Estates?\r\n</h2>\r\n<ul class=\"ticks\">\r\n    <li>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</li>\r\n    <li>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 day a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at you convenience.</li>\r\n    <li>Advertisement is very quick and easy to do; your property becomes live within 24hrs of completing the transaction.\r\n        One off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</li>\r\n    <li>We are a one stop shop or all your property needs.</li>\r\n    <li>Your property could be advertised up to 12 months and this gives you enough time to find a suitable buyer for your home.</li>\r\n    <li>We have a team that understand your local language and what you need.</li>\r\n</ul>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" class=\"signUP\">View pricing breakdown</a></p>\r\n\r\n</div>', 'International', '', 'inherit', 'open', 'open', '', '155-revision-14', '', '', '2011-01-07 02:02:26', '2011-01-07 02:02:26', '', '155', 'http://www.queensparkrealestates.co.uk/2011/01/07/155-revision-14/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('313', '1', '2011-01-07 02:05:28', '2011-01-07 02:05:28', '<h3>Pricing packages breakdown</h3>\r\n<p>We at Queens Park Real Estates has devised 3 different packages that should be suitable for all users depending on the services that they require for each property from Queens Park Real Estates. The breakdown below relates to the costs incurred per property and are payable upon submission of your property.</p>\r\n<p>When you are ready, <a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" >please register for an account,</a> and then add your property onto the system.</p>\r\n<div class=\"cols3container\">\r\n	<div class=\"col blue\">\r\n    	<div class=\"contentContainer\">\r\n        	<h2>Band A</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>12 months online and offline advertising with our prefered suppliers such as rightmove.co.uk (More than 1.6 million searches a month are carried out on Rightmove Overseas: we put your property where buyers are looking!)</li>\r\n                \r\n                <li>Advertising on selected property newspapers</li>\r\n                <li>We would provide all applicants your details and they can contact you directly</li>\r\n                <li>We will forward the details of all applicants to you so that your team can contact them directly</li>\r\n                <li>NO COMMISION IS CHARGED ON SALE  ONLY A ONE OF FEE OF <strong>£100</strong></li>\r\n                <li>Extra properties at <strong>£25</strong> per property.</li>\r\n             </ul>\r\n        </div>\r\n    </div>\r\n    <div class=\"col orange\">\r\n    	<h2>Band B</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band A</strong></li>\r\n                <li>Property Valuation</li>\r\n                <li>Detailed property breakdown including all measurements</li>\r\n                <li>Our photographer shall take professional shots of your property</li>\r\n                <li>Provide you advice as to simple improvements that can be made to the property to increase property price</li>\r\n                <li>Local newspaper advertising</li>\r\n                <li>Two properties in the same country - <strong>£350</strong></li>\r\n                <li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF <strong>£250</strong></li>\r\n                <li>Each next property in the same country - <strong>£50</strong></li>\r\n			</ul>\r\n    </div>\r\n    <div class=\"col green\">\r\n    	<h2>Band C</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band B</strong></li>\r\n                <li>We take charge of the sale of your property from valuation to completion</li>\r\n                <li>We are able to organise your proprty so that you are able to edit its details as and when needed</li>\r\n                <li>We will advise you on improvements to maximise the property value</li>\r\n                <li>The cost is <strong>£100</strong> and the sales commission (which varies from  one country to country, please ask our team what the applied sale  commission in your region)</li>\r\n           	</ul>\r\n    </div>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Sign Up for an account</a></p>\r\n\r\n</div>', 'Packages', '', 'inherit', 'open', 'open', '', '286-revision-15', '', '', '2011-01-07 02:05:28', '2011-01-07 02:05:28', '', '286', 'http://www.queensparkrealestates.co.uk/2011/01/07/286-revision-15/', '0', 'revision', '', '0');
