http://www.queensparkrealestates.co.uk/2010/12/22/155-revision-6/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('299', '1', '2011-01-07 00:04:02', '2011-01-07 00:04:02', '\r\n<p>Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.</p>\r\n\r\n<p>Our aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.</p>\r\n\r\n<p>At Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.</p>\r\n<h2>Why should I advertise my property with Queens Park Real Estates?\r\n</h2>\r\n<ul>\r\n    <li>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</li>\r\n    <li>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 day a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at you convenience.</li>\r\n    <li>Advertisement is very quick and easy to do; your property becomes live within 24hrs of completing the transaction.\r\n        One off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</li>\r\n    <li>We are a one stop shop or all your property needs.</li>\r\n    <li>Your property could be advertised up to 12 months and this gives you enough time to find a suitable buyer for your home.</li>\r\n    <li>We have a team that understand your local language and what you need.</li>\r\n</ul>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" class=\"signUP\">Sign Up for an account</a></p>\r\n', 'International', '', 'inherit', 'open', 'open', '', '155-revision-12', '', '', '2011-01-07 00:04:02', '2011-01-07 00:04:02', '', '155', 'http://www.queensparkrealestates.co.uk/2011/01/07/155-revision-12/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('300', '1', '2011-01-06 20:19:41', '2011-01-06 20:19:41', '<strong>Band A</strong> - With this band, your property receives maximum exposure  via the internet and all papers in which Queens Park Real Estates uses  as a marketing medium. At the moment we do use the best and most visited  websites, where your property can be viewed by all around the world. We  also use our website which is regularly updated and is visited by  millions of people around the world on a daily basis. Our marketing team  are working endlessly to give our properties maximum exposure and  improve our quality of service. All you need to do is send us the  details of the property to include pictures and we do the rest. We would  provide all applicants your details and they can contact you directly  also we would forward the details of all applicants to you and you can  contact them yourself. Under this band, NO COMMISION IS CHARGED ON SALE  ONLY A ONE OF FEE OF <strong>£100</strong>(which allows you to give your property maximum exposure for 12months). Two properties - <strong>£150</strong>, each next - <strong>£25</strong>.\r\n\r\n<strong>Band B</strong> - With this band, you enjoy all the facilities Band A  offers but in this case we give you a valuation, and take all  measurements and pictures ourselves we also advise you on your property   so you can achieve the highest market price possible. We also advertise  your property with our local representative in the respective region  (please confirm with our team that we do have an office in your  region).You communicate directly with all clients that indicates an  interest in your property. Under this band, NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF<strong>£250</strong>(which allows you to give your property maximum exposure for 12months). Two properties in the same country - <strong>£350</strong>, each next property in the same country - <strong>£50</strong>.\r\n\r\n<strong>Band C</strong> - We take charge of the sale of your property from valuation to completion. The charge for this band is <strong>£100</strong> BY THE MARKETING DEPARTMENT AND THE SALE COMMISSION (which varies from  one country to the other. Please ask our team what the applied sale  commission in your region is)', 'Packages', '', 'inherit', 'open', 'open', '', '286-revision-5', '', '', '2011-01-06 20:19:41', '2011-01-06 20:19:41', '', '286', 'http://www.queensparkrealestates.co.uk/2011/01/06/286-revision-5/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('301', '1', '2011-01-07 01:15:42', '2011-01-07 01:15:42', '<h3>Pricing packages breakdown</h3>\r\n<div class=\"cols3container\">\r\n	<div class=\"col blue\">\r\n    	<div class=\"contentContainer\">\r\n        	<h2>Band A</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>12 months online and offline advertising</li>\r\n                \r\n                <li>Submission of your property to numerious property websites worldwide such as rightmove.co.uk and propertyfinder.co.uk</li>\r\n                <li>Maximum online exposure for your property, with floor plans, pictures of the property, full and detailed property descriptions</li>\r\n                <li>Advertisement on property related newspapers that are part of the Queens Park Real Estates prefered list</li>\r\n                <li>We would provide all applicants your details and they can contact you directly</li>\r\n                <li>We will forward the details of all applicants to you so that your team can contact them directly</li>\r\n                <li>NO COMMISION IS CHARGED ON SALE  ONLY A ONE OF FEE OF <strong>£100</strong></li>\r\n                <li>Extra properties at £25 per property.</li>\r\n        </div>\r\n    </div>\r\n    <div class=\"col orange\">\r\n    	<h2>Band B</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band A</strong></li>\r\n                <li>Property Valuation</li>\r\n                <li>Detailed property breakdown including all measurements</li>\r\n                <li>Our photographer shall take professional shots of your property</li>\r\n                <li>Provide you advice as to simple improvements that can be made to the property to increase property price</li>\r\n                <li>Local news paper advertising</li>\r\n                <li>Two properties in the same country - <strong>£350</strong></li>\r\n                <li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF<strong>£250</strong></li>\r\n