INSERT INTO `wp_posts` VALUES ('305', '1', '2011-01-27 14:27:19', '2011-01-27 14:27:19', '<h3>our sale packages</h3>\nWe at Queens Park Real Estates have devised 3 different packages tailored to suit the marketing and sale requirements of your property and are as follows;\n<div class=\"cols3container\">\n<div class=\"col blue\">\n<div class=\"contentContainer\">\n<h2>Band A</h2>\n<ul class=\"ticks\">\n	<li>12 months online and offline advertisement  via the internet and all other marketing portals</li>\n	<li>Currently we advertise on our website and other popular and most visited property marketing sites around the world.</li>\n	<li>You are in total control of the advertisement of your property; all you need do is open an account with us, supply details of your property, upload pictures, and any other details you know would best portray the property.</li>\n	<li>You decide how you want applicants to contact you and they contact you directly</li>\n	<li>You arrange viewings at your convenience and negotiate the best price for your property</li>\n	<li>You can have the property on our site for 12months giving you enough time to advertise and complete.</li>\n	<li><strong>1 Property = £100 per year</strong></li>\n	<li><strong>2 Properties = £150 per year</strong></li>\n	<li><strong>more than 2 properties = £150 + £25 per extra property per year\n</strong></li>\n</ul>\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">Order this package</a>\n\n</div>\n</div>\n<div class=\"col orange\">\n<h2>Band B</h2>\n<ul class=\"ticks\">\n	<li>All options from <strong>Band A</strong></li>\n	<li>Property Valuation is provided</li>\n	<li>Professional pictures, floor plans and other document required by law are provided</li>\n	<li>Advice you as to simple improvements that can be made to the property to increase Value</li>\n	<li>Properties are marketed by our local representative in your region (please confirm with our team if we do have an office or representative in your region).</li>\n	<li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF £250</li>\n	<li><strong>DICOUNT APPLIES IF YOU ARE MARKETING MORE THAN ONE POPERTY</strong></li>\n</ul>\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">Order this package</a>\n\n</div>\n<div class=\"col green\">\n<h2>Band C</h2>\n<ul class=\"ticks\">\n	<li>All options from <strong>Band B</strong></li>\n	<li>We take charge of the sale of your property from valuation to completion</li>\n	<li>We arrange viewings on your behalf according to your instruction</li>\n	<li>Negotiate the best possible price for your property</li>\n	<li><strong>Cost of £100 and the sales commission applies ( this varies from one country to country, please ask our team what the applied sale commission in your region)</strong></li>\n</ul>\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">\nContact our team\n</a>\n\n</div>\n</div>', 'I want to SELL my property', '', 'inherit', 'open', 'open', '', '286-autosave', '', '', '2011-01-27 14:27:19', '2011-01-27 14:27:19', '', '286', 'http://www.queensparkrealestates.co.uk/2011/01/07/286-autosave/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('306', '1', '2011-01-07 01:28:16', '2011-01-07 01:28:16', '<h3>Pricing packages breakdown</h3>\r\n<div class=\"cols3container\">\r\n	<div class=\"col blue\">\r\n    	<div class=\"contentContainer\">\r\n        	<h2>Band A</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>12 months online and offline advertising</li>\r\n                \r\n                <li>Submission of your property to numerious property websites worldwide such as rightmove.co.uk and propertyfinder.co.uk</li>\r\n                <li>Maximum online exposure for your property, with floor plans, pictures of the property, full and detailed property descriptions</li>\r\n                <li>Advertisement on property related newspapers that are part of the Queens Park Real Estates prefered list</li>\r\n                <li>We would provide all applicants your details and they can contact you directly</li>\r\n                <li>We will forward the details of all applicants to you so that your team can contact them directly</li>\r\n                <li>NO COMMISION IS CHARGED ON SALE  ONLY A ONE OF FEE OF <strong>£100</strong></li>\r\n                <li>Extra properties at £25 per property.</li>\r\n             </ul>\r\n        </div>\r\n    </div>\r\n    <div class=\"col orange\">\r\n    	<h2>Band B</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band A</strong></li>\r\n                <li>Property Valuation</li>\r\n                <li>Detailed property breakdown including all measurements</li>\r\n                <li>Our photographer shall take professional shots of your property</li>\r\n                <li>Provide you advice as to simple improvements that can be made to the property to increase property price</li>\r\n                <li>Local news paper advertising</li>\r\n                <li>Two properties in the same country - <strong>£350</strong></li>\r\n                <li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF<strong>£250</strong></li>\r\n                <li>Each next property in the same country - <strong>£50</strong></li>\r\n			</ul>\r\n    </div>\r\n    <div class=\"col green\">\r\n    	<h2>Band C</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>We take charge of the sale of your property from valuation to completion</li>\r\n                <li>The cost is <strong>£100</strong> and the sales commission (which varies from  one country to the other. Please ask our team what the applied sale  commission in your region)</li>\r\n           	</ul>\r\n    </div>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" class=\"signUP\">Sign Up for an account</a></p>\r\n\r\n</div>', 'Packages', '', 'inherit', 'open', 'open', '', '286-revision-10', '', '', '2011-01-07 01:28:16', '2011-01-07 01:28:16', '', '286', 'http://www.queensparkrealestates.co.uk/2011/01/07/286-revision-10/', '0', 'revision', '', '0');
