>Provide you advice as to simple improvements that can be made to the property to increase property price</li>\r\n                <li>Local newspaper advertising</li>\r\n                <li>Two properties in the same country - <strong>£350</strong></li>\r\n                <li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF <strong>£250</strong></li>\r\n                <li>Each next property in the same country - <strong>£50</strong></li>\r\n			</ul>\r\n    </div>\r\n    <div class=\"col green\">\r\n    	<h2>Band C</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band B</strong></li>\r\n                <li>We take charge of the sale of your property from valuation to completion</li>\r\n                <li>We are able to organise your proprty so that you are able to edit its details as and when needed</li>\r\n                <li>We will advise you on improvements to maximise the property value</li>\r\n                <li>The cost is <strong>£100</strong> and the sales commission (which varies from  one country to country, please ask our team what the applied sale  commission in your region)</li>\r\n           	</ul>\r\n    </div>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" class=\"signUP\">Sign Up for an account</a></p>\r\n\r\n</div>', 'Packages', '', 'inherit', 'open', 'open', '', '286-revision-14', '', '', '2011-01-07 01:58:50', '2011-01-07 01:58:50', '', '286', 'http://www.queensparkrealestates.co.uk/2011/01/07/286-revision-14/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('280', '1', '2010-12-23 09:54:48', '2010-12-23 09:54:48', 'Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.\r\n\r\nOur aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.\r\n\r\nAt Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.\r\n\r\n<strong><span style=\"font-size: 14pt;\">Why should I advertise my property with Queens Park Real Estates? </span></strong>\r\n<p style=\"margin-bottom: 12pt;\"><strong> </strong></p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;quot;Times New Roman&amp;quot;;\"><strong> </strong></span></span></span>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;quot;Times New Roman&amp;quot;;\"> </span></span></span>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 day a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at you convenience.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;quot;Times New Roman&amp;quot;;\"><strong> </strong></span></span></span>Advertisement is very quick and easy to do; your property becomes live with 24hrs of completing the transaction.\r\nOne off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;quot;Times New Roman&amp;quot;;\"> </span></span></span>We are a one stop shop or all your property needs.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;quot;Times New Roman&amp;quot;;\"> </span></span></span>You property could be advertised up to 12 months and this gives you more than enough time to find a suitable buyer for your home.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &amp;quot;Times New Roman&amp;quot;;\"> </span></span></span>We have a team that understand your local language and understands exactly what you need.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt;\">', 'International', '', 'inherit', 'open', 'open', '', '155-revision-8', '', '', '2010-12-23 09:54:48', '2010-12-23 09:54:48', '', '155', 'http://www.queensparkrealestates.co.uk/2010/12/23/155-revision-8/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('278', '1', '2010-12-21 11:25:02', '2010-12-21 11:25:02', '<h2>Queens Park Landlord Services</h2>\r\n[singlepic id=6 float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\"><strong>We can tailor our services to your particular requirements, however:</strong>\r\n<ul>\r\n	<li>We Guarantee you don\'t pay us a penny and your not tied in unless we find you a tenant your happy with (no upfront fees at all)</li>\r\n	<li>Rent guarantee on your property for 6 or 12 months is available</li>\r\n	<li>We aim to keep our fees one of the lowest of any quality agent in the area</li>\r\n	<li>We only focus on Lettings and Management</li>\r\n	<li>We have a policy to always be upfront and honest</li>\r\n	<li>We take advantage of all the latest technology and tools to let your property quickly</li>\r\n	<li>The longest opening hours: In response to the demands of living and working we have found that many people cannot make viewings within most of our competitors working hours. We strive to make viewings and valuations at a time that is convenient to you up to 8.30pm, 7 days a week.</li>\r\n	<li>Quality 3rd party referencing to insure you get impartial checks to insure the highest caliber of tenants for your property.</li>\r\n</ul>\r\n<strong>Let Only Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels.</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out referencing on the tenant including credit checking.</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance with. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds</li>\r\n	<li>To organise a schedule of condition. (Full inventory available)</li>\r\n	<li>To forward all monies to the landlord via either bank transfer or cheque minus our agreed fee.</li>\r\n</ul>\r\n<strong>Full Management Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out reference on the tenant including credit checking</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds. To provide an inventory of the property and check the tenant in including taking meter readings</li>\r\n	<li>To organise a full Inventory, and do a property handover with the tenant</li>\r\n	<li>To respond to all disrepair reported to us from the tenant during the duration of the tenancy. To inform the landlord of any such reports, and obtain quotes so that action may be taken.</li>\r\n	<li>To comply with all reasonable instructions received from the landlord in relation to the management of the property in accordance to the principles of good management.</li>\r\n	<li>To carry out a check out once the tenant has vacated the property and advise the landlord of any discrepancies with the schedule of condition / inventory and state of the property.</li>\r\n	<li>To forward the rent to the landlord minus our agreed fee on a monthly basis. The landlord can choose to receive this either by bank transfer or cheque.</li>\r\n</ul>\r\n</div>', 'Landlords', '', 'inherit', 'open', 'open', '', '4-revision-12', '', '', '2010-12-21 11:25:02', '2010-12-21 11:25:02', '', '4', 'http://www.queensparkrealestates.co.uk/2010/12/21/4-revision-12/', '0', 'revision', '', '0');
