:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--><!--[if gte mso 10]> <style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style> <![endif]-->Due to popular demand we established the international department of Queens Park Real Estates, tailored to adapt to the economic climate of the different parts of the world and assist our current and potential clients sell or let their proprieties around the globe.\r\n\r\nOur aim is to assist homeowners and businesses irrespective of what part of the world they reside enter their properties in the global property market, hassle free and at the barest minimum cost.\r\n\r\nAt Queens Park Real Estates the greater the exposure you give to your property the higher the interest it receives which enables you achieve the best price for your property.\r\n\r\n<strong><span style=\"font-size: 14pt;\">Why do i advertise my property with Queens Park Real Estates? </span></strong>\r\n<p style=\"margin-bottom: 12pt;\"><strong> </strong></p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &quot;Times New Roman&quot;;\"><strong> </strong> </span></span></span>We advertise your property on all major marketing sites in the world thereby giving your property maximum exposure.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &quot;Times New Roman&quot;;\"> </span></span></span>We leave you in control of your property from advertisement (choice of words, picture and viewings) to the sale/letting, 24hrs 7 day a week. Who best sells a property if not the owner, you get instant messages from all enquiries made on your property and can arrange viewings at you convenience.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &quot;Times New Roman&quot;;\"><strong> </strong> </span></span></span>Advertisement is very quick and easy to do; your property becomes live with 24hrs of completing the transaction.\r\nOne off payment is required and you do not need to pay us any commission when you eventually sell or let your property (this depends on the package you require).</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &quot;Times New Roman&quot;;\"> </span></span></span>We are a one stop shop or all your property needs.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &quot;Times New Roman&quot;;\"> </span></span></span>You property could be advertised up to 12 months and this gives you more than enough time to find a suitable buyer for your home.</p>\r\n<p style=\"margin: 5pt 0cm 12pt 36pt; text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span><strong>·</strong><span style=\"font: 7pt &quot;Times New Roman&quot;;\"> </span></span></span>We have a team that understand your local language and understands exactly what you need.</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt;\"></p>\r\n\r\n<!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:TrackMoves /> <w:TrackFormatting /> <w:PunctuationKerning /> <w:ValidateAgainstSchemas /> <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid> <w:IgnoreMixedContent>false</w:IgnoreMixedContent> <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText> <w:DoNotPromoteQF /> <w:LidThemeOther>EN-GB</w:LidThemeOther> <w:LidThemeAsian>X-NONE</w:LidThemeAsian> <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript> <w:Compatibility> <w:BreakWrappedTables /> <w:SnapToGridInCell /> <w:WrapTextWithPunct /> <w:UseAsianBreakRules /> <w:DontGrowAutofit /> <w:SplitPgBreakAndParaMark /> <w:DontVertAlignCellWithSp /> <w:DontBreakConstrainedForcedTables /> <w:DontVertAlignInTxbx /> <w:Word11KerningPairs /> <w:CachedColBalance /> </w:Compatibility> <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel> <m:mathPr> <m:mathFont m:val=\"Cambria Math\" /> <m:brkBin m:val=\"before\" /> <m:brkBinSub m:val=\"&#45;-\" /> <m:smallFrac m:val=\"off\" /> <m:dispDef /> <m:lMargin m:val=\"0\" /> <m:rMargin m:val=\"0\" /> <m:defJc m:val=\"centerGroup\" /> <m:wrapIndent m:val=\"1440\" /> <m:intLim m:val=\"subSup\" /> <m:naryLim m:val=\"undOvr\" /> </m:mathPr></w:WordDocument> </xml><![endif]--><!--[if gte mso 9]><xml> <w:LatentStyles DefLockedState=\"false\" DefUnhideWhenUsed=\"true\"   DefSemiHidden=\"true\" DefQFormat=\"false\" DefPriority=\"99\"   LatentStyleCount=\"267\"> <w:LsdException Locked=\"false\" Priority=\"0\" SemiHidden=\"fal