INSERT INTO `wp_posts` VALUES ('318', '1', '2011-01-07 17:32:11', '2011-01-07 17:32:11', '<h3>Our Letting packages </h3>\r\n\r\n<p>We at Queens Park Real Estates have devised 3 different packages tailored to suit the marketing and letting requirements of your property and are as follows;</p>\r\n\r\n<div class=\"cols3container\">\r\n	<div class=\"col blue\">\r\n    	<div class=\"contentContainer\">\r\n        	<h2>Band A</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>3 months online and offline advertisement  via the internet and all other marketing portals</li>\r\n                \r\n                <li>Currently we advertise on our website and other popular and most visited property marketing sites around the world.</li>\r\n                <li>You are in total control of the advertisement of your property; all you need do is open an account with us, supply details of your property, upload pictures, and any other details you know would best portray the property.</li>\r\n                <li>You decide how you want applicants to contact you and they contact you directly</li>\r\n                <li>You arrange viewings at your convenience and negotiate the best price for your property</li>\r\n                <li>You can have the property on our site for 3 months giving you enough time to advertise and let. </li>\r\n                <li><strong>NO COMMISION IS CHARGED ON SALE ONLY A ONE OFF FEE OF £65</strong></li>\r\n             </ul>\r\n             <p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Order this package</a></p>\r\n\r\n        </div>\r\n    </div>\r\n    <div class=\"col orange\">\r\n    	<h2>Band B</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band A</strong></li>\r\n                <li>Property Valuation is provided</li>\r\n                <li>Professional pictures, floor plans and other document required by law are provided  </li>\r\n                <li>Advice you as to simple improvements that can be made to the property to increase Value</li>\r\n                <li>Properties are marketed by our local representative in your region (please confirm with our team if we do have an office or representative in your region).</li>\r\n                <li>NO COMMISION IS CHARGED ON LETTING ONLY A ONE OF FEE OF £155</li>\r\n                <li><strong>DICOUNT APPLIES IF YOU ARE MARKETING MORE THAN ONE POPERTY PLEASE AS A MEMBER OF OUR TEAM</strong>\r\n</li>\r\n                \r\n			</ul>\r\n            <p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Order this package</a></p>\r\n\r\n    </div>\r\n    <div class=\"col green\">\r\n    	<h2>Band C</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band B</strong></li>\r\n                <li>We take charge of the rental of your property from valuation, to finding you a professional tenants, reference checking and exchange of contract. </li> <li>We arrange viewings on your behalf according to your instruction</li> <li><strong>A COMMISSION FEE IS APPLICABLE,(this varies from one country to the other. Please ask our team what the applied letting commission in your region is) </strong></li> </ul> <p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Request a valuation</a></p> </div> </div>\r\n', 'I want to LET my property', '', 'publish', 'open', 'closed', '', 'i-want-to-let-my-property', '', '', '2011-01-30 11:30:37', '2011-01-30 11:30:37', '', '155', 'http://www.queensparkrealestates.co.uk/', '0', 'page', '', '0');
INSERT INTO `wp_posts` VALUES ('319', '1', '2011-01-07 17:31:41', '2011-01-07 17:31:41', '<h3>Pricing packages breakdown</h3>\n<p>We at Queens Park Real Estates has devised 3 different packages that should be suitable for all users depending on the services that they require for each property from Queens Park Real Estates. The breakdown below relates to the costs incurred per property and are payable upon submission of your property.</p>\n<p>When you are ready, <a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" >please register for an account,</a> and then add your property onto the system.</p>\n<div class=\"cols3container\">\n	<div class=\"col blue\">\n    	<div class=\"contentContainer\">\n        	<h2>Band A</h2>\n            <ul class=\"ticks\">\n    			<li>12 months online and offline advertising with our prefered suppliers such as rightmove.co.uk (More than 1.6 million searches a month are carried out on Rightmove Overseas: we put your property where buyers are looking!)</li>\n                \n                <li>Advertising on selected property newspapers</li>\n                <li>We would provide all applicants your details and they can contact you directly</li>\n                <li>We will forward the details of all applicants to you so that your team can contact them directly</li>\n                <li>NO COMMISION IS CHARGED ON SALE  ONLY A ONE OF FEE OF <strong>£100</strong></li>\n                <li>Extra properties at <strong>£25</strong> per property.</li>\n             </ul>\n        </div>\n    </div>\n    <div class=\"col orange\">\n    	<h2>Band B</h2>\n            <ul class=\"ticks\">\n    			<li>All options from <strong>Band A</strong></li>\n                <li>Property Valuation</li>\n                <li>Detailed property breakdown including all measurements</li>\n                <li>Our photographer shall take professional shots of your property</li>\n                <li>Provide you advice as to simple improvements that can be made to the property to increase property price</li>\n                <li>Local newspaper advertising</li>\n                <li>Two properties in the same country - <strong>£350</strong></li>\n                <li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF <strong>£250</strong></li>\n                <li>Each next property in the same country - <strong>£50</strong></li>\n			</ul>\n    </div>\n    <div class=\"col green\">\n    	<h2>Band C</h2>\n            <ul class=\"ticks\">\n    			<li>All options from <strong>Band B</strong></li>\n                <li>We take charge of the sale of your property from valuation to completion</li>\n                <li>We are able to organise your proprty so that you are able to edit its details as and when needed</li>\n                <li>We will advise you on improvements to maximise the property value</li>\n                <li>The cost is <strong>£100</strong> and the sales commission (which varies from  one country to country, please ask our team what the applied sale  commission in your region)</li>\n           	</ul>\n    </div>\n<p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Sign Up for an account</a></p>\n\n</div>', 'I want to rent', '', 'inherit', 'open', 'open', '', '318-revision', '', '', '2011-01-07 17:31:41', '2011-01-07 17:31:41', '', '318', 'http://www.queensparkrealestates.co.uk/2011/01/07/318-revision/', '0', 'revision', '', '0');
