INSERT INTO `wp_posts` VALUES ('324', '1', '2011-01-07 17:48:03', '2011-01-07 17:48:03', '<h3>Lettings Pricing packages breakdown</h3>\r\n<p>We at Queens Park Real Estates has devised 3 different packages that should be suitable for all users depending on the services that they require for each property from Queens Park Real Estates. The breakdown below relates to the costs incurred per property and are payable upon submission of your property.</p>\r\n<p>When you are ready, <a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" >please register for an account,</a> and then add your property onto the system.</p>\r\n<div class=\"cols3container\">\r\n	<div class=\"col blue\">\r\n    	<div class=\"contentContainer\">\r\n        	<h2>Band A</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>3 months online and offline advertisement  via the internet and all other marketing portals</li>\r\n                \r\n                <li>Currently we advertise on our website and other popular and most visited property marketing sites around the world.</li>\r\n                <li>You are in total control of the advertisement of your property; all you need do is open an account with us, supply details of your property, upload pictures, and any other details you know would best portray the property.</li>\r\n                <li>You decide how you want applicants to contact you and they contact you directly</li>\r\n                <li>You arrange viewings at your convenience and negotiate the best price for your property</li>\r\n                <li>You can have the property on our site for 12months giving you enough time to advertise and complete. </li>\r\n                <li><strong>NO COMMISION IS CHARGED ON SALE ONLY A ONE OFF FEE OF £75</strong></li>\r\n             </ul>\r\n        </div>\r\n    </div>\r\n    <div class=\"col orange\">\r\n    	<h2>Band B</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band A</strong></li>\r\n                <li>Property Valuation is provided</li>\r\n                <li>Professional pictures, floor plans and other document required by law are provided  </li>\r\n                <li>Advice you as to simple improvements that can be made to the property to increase Value</li>\r\n                <li>Properties are marketed by our local representative in your region (please confirm with our team if we do have an office or representative in your region).</li>\r\n                <li>NO COMMISION IS CHARGED ON SALE ONLY A ONE OF FEE OF £175</li>\r\n                <li><strong>DICOUNT APPLIES IF YOU ARE MARKETING MORE THAN ONE POPERTY</strong></li>\r\n                \r\n			</ul>\r\n    </div>\r\n    <div class=\"col green\">\r\n    	<h2>Band C</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band B</strong></li>\r\n                <li>We take charge of the rental of your property from valuation, to finding you a professional tenants, reference checking and exchange of contract. </li>\r\n                <li>We arrange viewings on your behalf according to your instruction</li>\r\n                <li><strong>A  COMMISSION FEE IS APPLICABLE,(this varies from one country to the other. Please ask our team what the applied letting commission in your region is) REQUEST A VALUATION</strong></li>\r\n           	</ul>\r\n    </div>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Sign Up for an account</a></p>\r\n\r\n</div>', 'I want to let', '', 'inherit', 'open', 'open', '', '318-revision-3', '', '', '2011-01-07 17:48:03', '2011-01-07 17:48:03', '', '318', 'http://www.queensparkrealestates.co.uk/2011/01/07/318-revision-3/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('325', '1', '2011-01-09 02:30:21', '2011-01-09 02:30:21', '<h3>Lettings Pricing packages breakdown</h3>\r\n<p>We at Queens Park Real Estates has devised 3 different packages that should be suitable for all users depending on the services that they require for each property from Queens Park Real Estates. The breakdown below relates to the costs incurred per property and are payable upon submission of your property.</p>\r\n<p>When you are ready, <a href=\"http://www.queensparkrealestates.co.uk/international/packages/\" >please register for an account,</a> and then add your property onto the system.</p>\r\n<div class=\"cols3container\">\r\n	<div class=\"col blue\">\r\n    	<div class=\"contentContainer\">\r\n        	<h2>Band A</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>4 months online and offline advertisement  via the internet and all other marketing portals</li>\r\n                \r\n                <li>Currently we advertise on our website and other popular and most visited property marketing sites around the world.</li>\r\n                <li>You are in total control of the advertisement of your property; all you need do is open an account with us, supply details of your property, upload pictures, and any other details you know would best portray the property.</li>\r\n                <li>You decide how you want applicants to contact you and they contact you directly</li>\r\n                <li>You arrange viewings at your convenience and negotiate the best price for your property</li>\r\n                <li>You can have the property on our site for 4 months giving you enough time to advertise and complete. </li>\r\n                <li><strong>NO COMMISION IS CHARGED ON SALE ONLY A ONE OFF FEE OF £75</strong></li>\r\n             </ul>\r\n        </div>\r\n    </div>\r\n    <div class=\"col orange\">\r\n    	<h2>Band B</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band A</strong></li>\r\n                <li>Property Valuation is provided</li>\r\n                <li>Professional pictures, floor plans and other document required by law are provided  </li>\r\n                <li>Advice you as to simple improvements that can be made to the property to increase Value</li>\r\n                <li>Properties are marketed by our local representative in your region (please confirm with our team if we do have an office or representative in your region).</li>\r\n                <li>NO COMMISION IS CHARGED ON LETTING ONLY A ONE OF FEE OF £175</li>\r\n                <li><strong>DICOUNT APPLIES IF YOU ARE MARKETING MORE THAN ONE POPERTY PLEASE AS A MEMBER OF OUR TEAM/strong></li>\r\n                \r\n			</ul>\r\n    </div>\r\n    <div class=\"col green\">\r\n    	<h2>Band C</h2>\r\n            <ul class=\"ticks\">\r\n    			<li>All options from <strong>Band B</strong></li>\r\n                <li>We take charge of the rental of your property from valuation, to finding you a professional tenants, reference checking and exchange of contract. </li>\r\n                <li>We arrange viewings on your behalf according to your instruction</li>\r\n                <li><strong>A  COMMISSION FEE IS APPLICABLE,(this varies from one country to the other. Please ask our team what the applied letting commission in your region is) REQUEST A VALUATION</strong></li>\r\n           	</ul>\r\n    </div>\r\n<p><a href=\"http://www.queensparkrealestates.co.uk/my-account/\" class=\"signUP\">Sign Up for an account</a></p>\r\n\r\n</div>', 'I want to let', '', 'inherit', 'open', 'open', '', '318-revision-4', '', '', '2011-01-09 02:30:21', '2011-01-09 02:30:21', '', '318', 'http://www.queensparkrealestates.co.uk/2011/01/09/318-revision-4/', '0', 'revision', '', '0');
