INSERT INTO `wp_posts` VALUES ('336', '1', '2010-12-21 11:50:12', '2010-12-21 11:50:12', '<h1>Welcome to Queens Park Real Estates</h1>\r\nQueens Park Real Estates an independent letting ,sale and managing agents of residential properties in Kilburn, West Hampstead, Brondesbury, Queens Park, Mapesbury, Cricklewood, Willesden Green, Willesden, Neasden, Kensal Rise, Kensal Green, Kingsbury and Part of Middlesex area and around London\r\nFounded in 1991 Queens Park Real Estates has a comprehensive knowledge of our local area and based on our continuous loyalty and undivided attention our agents give to our clients (seller, vendors, buyer and tenants) they keep coming back and recommending us to others\r\n\r\nWe provide a full management service if required and maintain competitive commission rates on a no sale-no fees basis.\r\nOur agents are trained to uphold high values of the industry, rendering excellent service to all our clients. We are also a member of the Ombudsman Scheme which adheres to the strict codes of practice.\r\nWhy not speak to one of our agents now for more details on 0207 372 5950 or email us on info@queensparkrealestates.co.uk', 'Home', '', 'inherit', 'open', 'open', '', '32-revision-12', '', '', '2010-12-21 11:50:12', '2010-12-21 11:50:12', '', '32', 'http://www.queensparkrealestates.co.uk/2010/12/21/32-revision-12/', '0', 'revision', '', '0');
