INSERT INTO `wp_posts` VALUES ('384', '1', '2011-03-14 14:10:46', '2011-03-14 14:10:46', '<h3>our sale packages</h3>\r\nWe at Queens Park Real Estates have devised 3 different packages tailored to suit the marketing and sale requirements of your property and are as follows;\r\n<div class=\"cols3container\">\r\n<div class=\"col blue\">\r\n<div class=\"contentContainer\">\r\n<h2>Band A</h2>\r\n<ul class=\"ticks\">\r\n	<li>12 months online and offline advertisement  via the internet and all other marketing portals</li>\r\n	<li>Currently we advertise on our website and other popular and most visited property marketing sites around the world.</li>\r\n	<li>You are in total control of the advertisement of your property; all you need do is open an account with us, supply details of your property, upload pictures, and any other details you know would best portray the property.</li>\r\n	<li>You decide how you want applicants to contact you and they contact you directly</li>\r\n	<li>You arrange viewings at your convenience and negotiate the best price for your property</li>\r\n	<li>You can have the property on our site for 12months giving you enough time to advertise and complete.</li>\r\n	<li><strong>1 Property = £100 per year</strong></li>\r\n	<li><strong>2 Properties = £150 per year</strong></li>\r\n	<li><strong>more than 2 properties = £150 + £25 per extra property per year\r\n</strong></li>\r\n</ul>\r\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">Order this package</a>\r\n\r\n</div>\r\n</div>\r\n<div class=\"col orange\">\r\n<h2>Band B</h2>\r\n<ul class=\"ticks\">\r\n	<li>All options from <strong>Band A</strong></li>\r\n	<li>Property Valuation is provided</li>\r\n	<li>Professional pictures, floor plans and other document required by law are provided</li>\r\n	<li>Advice you as to simple improvements that can be made to the property to increase Value</li>\r\n	<li>Properties are marketed by our local representative in your region (please confirm with our team if we do have an office or representative in your region).</li>\r\n	<li><strong>1 Property = £250 per year</strong></li>\r\n	<li><strong>2 Properties in the same country = £350 per year</strong></li>\r\n	<li><strong>more than 2 properties in the same country = £350 + £50 per extra property per year\r\n</strong></li>\r\n</ul>\r\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">Order this package</a>\r\n\r\n</div>\r\n<div class=\"col green\">\r\n<h2>Band C</h2>\r\n<ul class=\"ticks\">\r\n	<li>All options from <strong>Band B</strong></li>\r\n	<li>We take charge of the sale of your property from valuation to completion</li>\r\n	<li>We arrange viewings on your behalf according to your instruction</li>\r\n	<li>Negotiate the best possible price for your property</li>\r\n	<li><strong>Cost of £100 and the sales commission applies ( this varies from one country to country, please ask our team what the applied sale commission in your region)</strong></li>\r\n</ul>\r\n<a class=\"signUP\" href=\"http://www.queensparkrealestates.co.uk/my-account/\">\r\nContact our team\r\n</a>\r\n\r\n</div>\r\n</div>', 'I want to SELL my property', '', 'inherit', 'open', 'open', '', '367-revision-3', '', '', '2011-03-14 14:10:46', '2011-03-14 14:10:46', '', '367', 'http://www.queensparkrealestates.co.uk/2011/03/14/367-revision-3/', '0', 'revision', '', '0');
