m agreed in accordance with. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds</li>\r\n	<li>To organise a schedule of condition. (Full inventory available)</li>\r\n	<li>To forward all monies to the landlord via either bank transfer or cheque minus our agreed fee.</li>\r\n</ul>\r\n<strong>Full Management Service</strong>\r\n<p class=\"subheadings\">Queens Park will provide the following services</p>\r\n\r\n<ul>\r\n	<li>To prepare details for the purpose of marketing. To advertise where we consider to be the most effective according to market conditions and historic advertising response levels</li>\r\n	<li>To negotiate an acceptable monthly rent and term between the landlord and the tenant. To carry out reference on the tenant including credit checking</li>\r\n	<li>To prepare an assured shorthold tenancy agreement for the monthly rent and term agreed in accordance. To collect 1 calendar month’s rent in advance and the damage deposit in cleared funds. To provide an inventory of the property and check the tenant in including taking meter readings</li>\r\n	<li>To organise a full Inventory, and do a property handover with the tenant</li>\r\n	<li>To respond to all disrepair reported to us from the tenant during the duration of the tenancy. To inform the landlord of any such reports, and obtain quotes so that action may be taken.</li>\r\n	<li>To comply with all reasonable instructions received from the landlord in relation to the management of the property in accordance to the principles of good management.</li>\r\n	<li>To carry out a check out once the tenant has vacated the property and advise the landlord of any discrepancies with the schedule of condition / inventory and state of the property.</li>\r\n	<li>To forward the rent to the landlord minus our agreed fee on a monthly basis. The landlord can choose to receive this either by bank transfer or cheque.</li>\r\n</ul>\r\n</div>', 'Landlords', '', 'inherit', 'open', 'open', '', '4-revision-14', '', '', '2011-06-02 13:38:58', '2011-06-02 13:38:58', '', '4', 'http://www.queensparkrealestates.co.uk/2011/06/02/4-revision-14/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('399', '1', '2011-06-02 16:46:43', '2011-06-02 16:46:43', '<h2>Queens Park Landlord Services</h2>\r\nWe do offer various services to our landlords, as listed below and we are more than happy to tailor these services to meet your requirements;\r\n[singlepic id=6 float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\"><strong>Letting only:</strong>\r\n<ul>\r\n	<li>We market your property via our different marketing portals)</li>\r\n	<li>We arrange viewing according to your instructions</li>\r\n	<li>We inform you of all offers received and allow you to make your choice of a suitable tenant</li>\r\n	<li>Taking and holding of the deposit paid</li>\r\n	<li>We have a policy to always be upfront and honest</li>\r\n	<li>We apply for the potential tenants references</li>\r\n	<li>We agree with both parties (landlord and tenant) on a move in date and draw up a tenancy agreement. This can be tailored to suit individual situation to reflect all terms agreed and are able to tailor the tenancy agreement to suit individual circumstances</li>\r\n	<li>Conduct the check- in (inventory) on the move in date</li>\r\n             <li>Transfer utility accounts to the names of the new tenants</li>\r\n             <li>We prepare a statement of account and pass on all due rents to the landlord  as soon as administratively possible </li>\r\n             <li>Accounting to the Inland Revenue for tax purposes where applicable</li>\r\n             <li>Serving of notices to tenants where necessary at an extra charge</li>\r\n             <li>We also check tenants out of the property at the end of tenancy</li>\r\n\r\n</ul>\r\n<strong>Letting and Management</strong>\r\n<p class=\"subheadings\">Under the letting and management services we carry out all the services under the letting only above and in addition the other services listed below;</p>\r\n<ul>\r\n	<li>Some landlords live abroad or just too busy to deal with the day to day repairs and maintenance of their property. As managing agents we do all this for you</li>\r\n	<li>Rent guarantee insurance </li>\r\n	<li>We arrange for the renewal of the annual gas and electric checks </li>\r\n	<li>We do carry out a periodic visit to the property</li>\r\n	<li>Comparing the schedule of check in against the check out and providing an estimate for the cost of damage</li>\r\n             <li>Negotiating between parties over dispute arising as a result of damages</li>\r\n             <li>Serving a notice at the end of tenancy</li>\r\n             <li>Representing the landlord in court if need be</li>\r\n             <li>Overseeing refurbishment work carried out in the property</li>\r\n</ul>\r\n<strong>Management Only</strong>\r\n<p class=\"subheadings\">For landlords who have secured the tenants themselves and all they need is an agent to manage the property in their absence. We are able to provide all the services listed below;</p>\r\n<ul>\r\n	<li>As managing agents we deal with the maintenance and day to day repairs of your property</li>\r\n	<li>We arrange for the renewal of the annual gas and electric checks </li>\r\n	<li>We do carry out a periodic visit to the property</li>\r\n	<li>Negotiate renewal of the existing tenancy agreement </li>\r\n	<li>Serving a notice at the end of tenancy</li>\r\n	<li>Representing the landlord in court if need be</li>\r\n	<li>Overseeing refurbishment work carried out in the property.</li>\r\n	</ul>\r\n</div>', 'Landlords', '', 'inherit', 'open', 'open', '', '4-revision-16', '', '', '2011-06-02 16:46:43', '2011-06-02 16:46:43', '', '4', 'http://www.queensparkrealestates.co.uk/2011/06/02/4-revision-16/', '0', 'revision', '', '0');
