INSERT INTO `wp_posts` VALUES ('414', '1', '2011-06-04 22:59:00', '2011-06-04 22:59:00', '<h2>Queens Park Landlord Services</h2>\r\nOur Services listed below are designed to satisfy your needs and if we have not covered some of your requirements we are here to discuss and incorporate them. \r\n[singlepic id=6 float=]\r\n<div id=\"landlordServices\" class=\"WebsiteContent\"><strong>Letting only:</strong>\r\n<ul>\r\n\r\n•	We marketing the property via our different marketing portals\r\n•	We arrange viewing according to your instruction.\r\n•	We inform you of all offers received and allow you make your choice on a suitable tenant\r\n•	Taking and holding of the deposit paid\r\n•	We apply for the potential tenants references\r\n•	We agree with both parties (landlord and tenant) on a move in date and draw up a tenancy agreement. This can be tailored to suit individual situation to reflect all terms agreed and are able to tailor the tenancy agreement to suit individual circumstances\r\n•	Conduct the check- in (inventory) on the move in date\r\n•	Transfer utility accounts to the names of the new tenants\r\n•	We prepare a statement of account and pass on all due rents to the landlord  as soon as administratively possible \r\n•	Accounting to the Inland Revenue for tax purposes where applicable.\r\n•	Serving of notices to tenants where necessary at an extra charge.\r\n•	We also check tenants out of the property at the end of tenancy.\r\n</ul>\r\n<strong>Letting and management</strong>\r\n<p class=\"subheadings\">Under the letting and management services we carry out all the services under the letting only package in addition to the other services listed below;</p>\r\n\r\n<ul>\r\n•	Some landlords live abroad or just too busy to deal with the day to day repairs and maintenance of their property. As managing agents we do all this for you.\r\n•	Rent guarantee insurance\r\n•	We arrange for the renewal of the annual gas and electric checks \r\n•	We do carry out a periodic visit to the property\r\n•	Comparing the schedule of check in against the check out and providing an estimate for the cost of damage.\r\n•	Negotiating between parties over dispute arising as a result of damages\r\n•	Serving a notice at the end of tenancy\r\n•	Representing the landlord in court if need be\r\n•	Overseeing refurbishment work carried out in the property\r\n</ul>\r\n<strong>Management only</strong>\r\n<p class=\"subheadings\">For landlords who have secured the tenants themselves and all they need is an agent to manage the property in their absence. We are able to provide all the services listed below;</p>\r\n\r\n<ul>\r\n	•	As managing agents we deal with the maintenance and day to day repairs of your property.\r\n•	We arrange for the renewal of the annual gas and electric checks \r\n•	We do carry out a periodic visit to the property\r\n•	Arrange for renewal of the existing tenancy agreement \r\n•	Serving a notice at the end of tenancy\r\n•	Representing the landlord in court if need be\r\n•	Overseeing refurbishment work carried out in the property\r\n\r\n</ul>\r\n</div>', 'Landlords', '', 'inherit', 'open', 'open', '', '4-revision-27', '', '', '2011-06-04 22:59:00', '2011-06-04 22:59:00', '', '4', 'http://www.queensparkrealestates.co.uk/2011/06/04/4-revision-27/', '0', 'revision', '', '0');
