INSERT INTO `wp_posts` VALUES ('440', '1', '2011-07-06 15:40:02', '2011-07-06 15:40:02', '[gallery columns=\"4\"]<a href=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/07/Salusbury_Road_NW6_-_geograph_org_uk_-_379108.jpg\"><img src=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/07/Salusbury_Road_NW6_-_geograph_org_uk_-_379108-150x150.jpg\" alt=\"\" title=\"Salusbury_Road,_NW6_-_geograph_org_uk_-_379108\" width=\"150\" height=\"150\" class=\"aligncenter size-thumbnail wp-image-433\" /></a><a href=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/07/47135_113800015343980_100001419465463_112455_6298166_n.jpg\"><img src=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/07/47135_113800015343980_100001419465463_112455_6298166_n-150x150.jpg\" alt=\"\" title=\"47135_113800015343980_100001419465463_112455_6298166_n\" width=\"150\" height=\"150\" class=\"aligncenter size-thumbnail wp-image-431\" /></a><a href=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/07/kilburn-shopping-350x250_10992.jpg\"><img src=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/07/kilburn-shopping-350x250_10992-150x150.jpg\" alt=\"\" title=\"Salusbury Road\" width=\"150\" height=\"150\" class=\"aligncenter size-thumbnail wp-image-429\" /></a>Windermere Avenue is highly prized, its period architecture well-preserved\r\nKilburn is keen to be posh\r\nThey may share a postcode — NW6 — and they may be only a few streets apart, but there is an important difference: buyers are prepared to pay 25 per cent more to live in gentrified Queen’s Park than in Kilburn, its less-posh neighbour. \r\n\r\nTen years ago, families wanting more space than they could afford in West Hampstead or Notting Hill discovered the quiet streets around Queen’s Park. The well-kept park, good transport links and solid, spacious Victorian terraces were a big draw for the middle classes and the area gentrified rapidly. The tighter grids of streets between Willesden Cemetery and Kilburn High Road proved more resistant to change, with many houses split into flats and traffic noise constant.\r\n\r\nProperty prices reflect the difference between the two areas. Kilburn’s location between Queen’s Park and the equally smart district of West Hampstead could turn its fortunes round. \r\n\r\nTraditional communities, such as the Irish, are moving out of Kilburn, he adds. Middle-class English and Asian buyers are replacing them, along with a younger Jewish generation. “Their parents moved to suburbs like Radlett but the children are buying here because they want something trendier and less suburban.” \r\n\r\n\r\nLowdown on NW6\r\n \r\n<strong>The area attracts: </strong>families looking for space and an easy journey to work; young professionals; BBC employees, plus other media workers and creative types; Asian families wanting to be close to the state-funded Islamia schools founded by Yusuf Islam (formerly the pop star Cat Stevens); buyers trading up to houses from flats in surrounding areas such as Hampstead, Notting Hill and Maida Vale. \r\n\r\n<strong>Staying power:</strong> very good in Queen’s Park. Locals are prepared to invest a lot of time and energy in the area: they run an active residents association and organise community events. The residents association organises the Queen’s Park Day every September and there’s an Open Gardens Day.”\r\n\r\n\r\n<strong>Best postcode:</strong> Kilburn and Queen’s Park are both in NW6, a postcode which also includes West Hampstead. One of the attractions for middle-class buyers moving to Queen’s Park in the early days of gentrification was that it shared a postcode with well-heeled West Hampstead but this is less relevant now Queen’s Park is well-established.\r\nBest streets: The closer you are to Queen’s Park itself, the better. In the grid between Salusbury Road and Kingswood Avenue to the west of the park, the most prized streets include Summerfield Avenue and Windermere Avenue, where the Victorian visual unity is well-preserved without ugly post-war development. \r\n\r\n<strong>Up-and-coming areas:</strong> The big dividing lines are Salusbury Road and Chamberlayne Road, which respectively mark the eastern and western boundaries of Queen’s Park. East of Salusbury Road, towards Kilburn, is cheaper than Queen’s Park. Check out roads in the grid between Priory Park Road and Tennyson Road for Victorian terraces. Kensal Rise to the west of Queen’s Park is also worth a look. Victorian properties in streets west of Chamberlayne Road are about 25 per cent cheaper than Queen’s Park \r\n\r\n<strong>What’s new:</strong> Both Kilburn and Queen’s Park are built up and space is at a premium, so developments tend to be one-offs rather than large, new-build blocks. But there are some subtle changes to shops and streets as the \r\nripples of gentrification slide outwards from Queen’s Park into Kensal Rise, with locals remarking on the arrival of new gastropubs and smart shops in Chamberlayne Road and parallel College Road.\r\n\r\n<strong>Schools:</strong> Brent council’s schools score well in league tables. Many residents are happy to send their children to state schools, including Salusbury Primary and Queen’s Park Community schools. Others opt for private schools in Highgate, Hampstead or Notting Hill.\r\n\r\n<strong>Shops and restaurants:</strong> Salusbury Road, the main shopping street in Queen’s Park, has a great choice of delis, cafés and restaurants, as well as a Sunday farmers’ market at Salusbury Primary School, and the street is lined with independent shops. \r\n\r\n<strong>Green space/culture:</strong> Queen’s Park, owned and run by the Corporation of London, is a beautifully kept focal point for community events. For a fascinating walk through Victorian history, sign up for a tour of Kensal Green cemetery and the catacombs. Kilburn’s Tricycle Theatre and Cinema is a haven of cool modernity off Kilburn High Road, showing critically rated and challenging plays based on modern-day events including the murder of Stephen Lawrence and the Army suicides at Deepcut Barracks.\r\n\r\n<strong>Transport:</strong> Kilburn and Queen’s Park are ringed by Tube stations on the Bakerloo and Jubilee lines and the North London line stops at Kensal Rise on its journey through inner-north London suburbia. \r\n\r\n<strong>Average sales prices:</strong>One bedroom flat: £266,573 \r\nTwo-bedroom flat: £393,942 \r\nTwo-bedroom house: £643,333\r\nThree-bedroom house: £730,667 \r\nFour-bedroom house: £871,467 \r\n(source: Hometrack) \r\n\r\n\r\nRenting\r\n\r\nAs in most parts of London, there is a shortage of property to rent, which is pushing rents up. \r\n<strong>Average lettings prices: NW6</strong>\r\nOne-bedroom flat: £250+pw\r\nTwo-bedroom flat: £300+pw \r\nThree-bedroom house: £600+pw \r\nFour-bedroom house: £700+pw\r\n', 'Spotlight on Kilburn and Queen\'s Park', '', 'inherit', 'open', 'open', '', '425-revision-8', '', '', '2011-07-06 15:40:02', '2011-07-06 15:40:02', '', '425', 'http://www.queensparkrealestates.co.uk/2011/07/06/425-revision-8/', '0', 'revision', '', '0');
