INSERT INTO `wp_posts` VALUES ('468', '1', '2011-09-21 15:09:44', '2011-09-21 15:09:44', 'Landlord\'s gas safety certificate\n\nThere is no reference in the UK law or in HSE to \"Landlord\'s gas safety certificate\" - only to having a \"record\" of an \"annual gas safety check\". However the folowing is generally required by *UK law.\n \nA Gas safety record is a record, also referred to as a certificate, that is required by law to be held for all rental accommodation in the UK where there are gas appliances present. The requirement is enshrined in the Gas Safety (Installation and Use) Regulations 1998. The law requires all gas appliances in a rented property to be checked annually, with a gas safety record being completed and a copy provided to tenants.\n \n<strong>Need a gas safety certificate? Do not hesitate to contact us on 020 7372 5950 or on qprealestates@btconnect.com</strong>', '', '', 'inherit', 'open', 'open', '', '465-revision-2', '', '', '2011-09-21 15:09:44', '2011-09-21 15:09:44', '', '465', 'http://www.queensparkrealestates.co.uk/2011/09/21/465-revision-2/', '0', 'revision', '', '0');
