INSERT INTO `wp_posts` VALUES ('470', '1', '2011-09-21 16:11:55', '2011-09-21 15:11:55', '<a href=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/09/medium_iStock_000012354061XSmall.jpg\"><img src=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/09/medium_iStock_000012354061XSmall.jpg\" alt=\"\" title=\"medium_iStock_000012354061XSmall\" width=\"200\" height=\"137\" class=\"alignright size-full wp-image-467\" /></a>Landlord\'s gas safety certificate \r\n\r\nThere is no reference in the UK law or in HSE to \"Landlord\'s gas safety certificate\" - only to having a \"record\" of an \"annual gas safety check\". However the folowing is generally required by *UK law.\r\n \r\nA Gas safety record is a record, also referred to as a certificate, that is required by law to be held for all rental accommodation in the UK where there are gas appliances present. The requirement is enshrined in the Gas Safety (Installation and Use) Regulations 1998. The law requires all gas appliances in a rented property to be checked annually, with a gas safety record being completed and a copy provided to tenants.\r\n \r\n<strong>Need a gas safety certificate? Do not hesitate to contact us on 020 7372 5950 or on qprealestates@btconnect.com</strong>', '', '', 'inherit', 'open', 'open', '', '465-revision-3', '', '', '2011-09-21 16:11:55', '2011-09-21 15:11:55', '', '465', 'http://www.queensparkrealestates.co.uk/2011/09/21/465-revision-3/', '0', 'revision', '', '0');
