INSERT INTO `wp_posts` VALUES ('479', '1', '2011-09-21 16:22:27', '2011-09-21 15:22:27', '                                                                                         <a href=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/09/medium_iStock_000012354061XSmall2.jpg\"><img src=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/09/medium_iStock_000012354061XSmall2-150x137.jpg\" alt=\"\" title=\"medium_iStock_000012354061XSmall\" width=\"150\" height=\"137\" class=\"aligncenter size-thumbnail wp-image-474\" /></a>\r\n\r\n                            There is no reference in the UK law or in HSE to \"Landlord\'s gas safety certificate\" - only to having a \"record\" of an \"annual gas safety check\". However the folowing is generally required by UK law.\r\n \r\n                            A Gas safety record is a record, also referred to as a certificate, that is required by law to be held for all rental accommodation in the UK where there are gas appliances present. The requirement is enshrined in the Gas Safety (Installation and Use) Regulations 1998. \r\n\r\nThe law requires all gas appliances in a rented property to be checked annually, with a gas safety record being completed and a copy provided to tenants.\r\n \r\n<strong>Need a gas safety certificate? Do not hesitate to contact us on 020 7372 5950 or on qprealestates@btconnect.com</strong>', 'Landlord\'s Gas Safety Certificate', '', 'inherit', 'open', 'open', '', '465-autosave', '', '', '2011-09-21 16:22:27', '2011-09-21 15:22:27', '', '465', 'http://www.queensparkrealestates.co.uk/2011/09/21/465-autosave/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES ('480', '1', '2011-09-21 16:18:49', '2011-09-21 15:18:49', '                                                                                         <strong>Landlord\'s gas safety certificate                 </strong>\r\n <a href=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/09/medium_iStock_000012354061XSmall2.jpg\"><img src=\"http://www.queensparkrealestates.co.uk/wp-content/uploads/2011/09/medium_iStock_000012354061XSmall2-150x137.jpg\" alt=\"\" title=\"medium_iStock_000012354061XSmall\" width=\"150\" height=\"137\" class=\"aligncenter size-thumbnail wp-image-474\" /></a>\r\n                            There is no reference in the UK law or in HSE to \"Landlord\'s gas safety certificate\" - only to having a \"record\" of an \"annual gas safety check\". However the folowing is generally required by UK law.\r\n \r\n                            A Gas safety record is a record, also referred to as a certificate, that is required by law to be held for all rental accommodation in the UK where there are gas appliances present. The requirement is enshrined in the Gas Safety (Installation and Use) Regulations 1998. The law requires all gas appliances in a rented property to be checked annually, with a gas safety record being completed and a copy provided to tenants.\r\n \r\n<strong>Need a gas safety certificate? Do not hesitate to contact us on 020 7372 5950 or on qprealestates@btconnect.com</strong>', '', '', 'inherit', 'open', 'open', '', '465-revision-11', '', '', '2011-09-21 16:18:49', '2011-09-21 15:18:49', '', '465', 'http://www.queensparkrealestates.co.uk/2011/09/21/465-revision-11/', '0', 'revision', '', '0');
